INSERT INTO places VALUES(696,'\ 代官山でイタリア邸宅に居るよう優雅な空間でカフェ/ イタリアの伝統的な料理をヨーロッパの日常に迷い込んだような空間で楽しむことができます🇮🇹 📍代官山　カフェ•ミケランジェロ 【夜のメニュー】 •田舎風パテ •小海老とブロッコリーのアリオリオマリネ •メカジキのシチリア風 •蛸とセロリのサラダ •鮮魚のカルパッチョ •トマトとバジルソースのピンサ•ロマーナ どれも本当に絶品でしたが、特にメカジキのシチリア風が美味しすぎて感動したので絶対に食べて欲しいです！！ •建物について Villa ASOは昭和初期に建てられた邸宅を大切に受け継いできた建物で、イタリア料理店の「リストランテASO」とヨーロピアンスタイルのカフェ「カフェ•ミケランジェロ」を舞台に、日常のひと時から生涯の思い出となるウエディングまで、さまざまなライフシーンを彩る場所になってます！ 今回、巡ったVilla ASOの建物の手前にある「カフェ•ミケランジェロ」是非、巡ってみてください🍽️ 【カフェ情報】 •店舗名:カフェ•ミケランジェロ •アクセス:代官山駅から徒歩7分 •住所:東京都渋谷区猿楽町29-3 •営業時間:平日:11:00-22:00  土日:10:30-22:00 •定休日:水曜日 •ペット可能 #fyp #代官山カフェ #イタリアン ',38300,1100000,'takuyajapanesefood0788','["fyp","代官山カフェ","イタリアン"]','https://m.tiktok.com/v/7363230023622462721','東京都渋谷区猿楽町29-3 (代官山駅から徒歩7分)','カフェ・ミケランジェロ','代官山にあるカフェ「カフェ・ミケランジェロ」を紹介する投稿です。昭和初期に建てられた邸宅を改装した建物内にあり、イタリアの伝統的な料理をヨーロッパの邸宅のような優雅な空間で楽しめるカフェとして紹介されています。メカジキのシチリア風など、いくつかのメニューが紹介されており、特にメカジキのシチリア風は絶品だとコメントされています。営業時間は平日11:00-22:00、土日10:30-22:00、定休日は水曜日、ペット同伴可能と詳細な情報が記載されています。',35.64858819999999895,139.699426299999999,'2025-04-17T09:50:06.283+00:00','2025-04-18T03:05:27.204+00:00','29-3 Sarugakuchō, Shibuya, Tokyo 150-0033, Japan','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcIkCM1VtP28nHXHxkborqxDOPtrCDJZsW_fvVsb3zCaJxO9vDPIERimGLNWIOr8jQZSx3GixkSulffQ8EshPocGG4d62oxma08amfs8h-n2fdeO-ZJcrE7UzcxPgyYLkUFJRzKMXtSoUvg05SMNnnR68HDcNZJ4dcdtVwHochTGv0GaKN1O8qNf55svmAAfSb3NHNIWYKZzI4FjH4aZ2G_Cx9UbZB--aboEfqNlzn5LRloiPfbfpSW7MtL95n-S9DuUNfM9O5qWAvBKlwMtO7QPS1pxCwC5n8EVY_whhK7UgQHer3wCYEyj_3KdT37tNVrUPF9pphs&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NULL);
