INSERT INTO places VALUES(711,'「人混みは嫌だけど、お洒落なカフェで過ごしたい☕️」って時に選ぶのがここ。 （セムラもあるよ…） 去年の5月にオープンしたけど、SNSにもほとんど載ってない穴場カフェで、アカウントからお洒落なセンス。 キャロットケーキが400円だし、パンも250円くらいから買えちゃう🥐 休みの日はこんな空間で珈琲と小麦に溺れたい…😮‍💨 知る人ぞ知る感あって良い 「バッケン」って読むらしい。 #カフェ#東京カフェ#カフェ巡り#国分寺',30400,783600,'tokyo_cafe_kou','["カフェ","東京カフェ","カフェ巡り","国分寺"]','https://m.tiktok.com/v/7462353359463402759','国分寺','バッケン','国分寺にある、まだあまり知られていない穴場のカフェ「バッケン」を紹介する投稿です。おしゃれな空間で、人混みを避けたい人におすすめとのこと。セムラやキャロットケーキ、パンなどが比較的リーズナブルな価格で提供されているようです。お店の雰囲気は落ち着いた感じで、休日にゆっくりと過ごしたいカフェとして紹介されています。',35.69664130000000313,139.4808275000000037,'2025-04-17T09:50:06.314+00:00','2025-04-18T03:05:32.935+00:00','Japan, 〒185-0021 Tokyo, Kokubunji, Minamichō, 3-chōme−1−３３ サンハイツ国分寺','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcKtV5wxmNUgb4FluxC7500RuPgOd-IlbDKj8mmcQyKndM2LCz25ARIR1vk4U6_vWnaYdnU_JzFGBboqJJ_or-zIb_kEXN-QS-ChygAfKgAJ6vCDLrS50apcxKlBY7vWK9MnX4obM0wI7JhBW5Ujh7zW9QSbTtO7GonJFn2vWNWA78k7L81s1Awd3rvrDPq0qVwOZVsYrL7rj3DCXi-wbA9lww6oqEcs74Ypk3Z26NeLdd61eZWAGXfvQAll_xF4dls1cGrJXOTzDMHJ993HmL4j607uxwh7OQN8I96eo9g_n3TCmw52TLKnqN7zsGpC7fXbMoIjqcMhkM-IRUezobMY3_5JqC1sLHrmXapCRKWByqMYvGbzss3eyL_4hu4G4bJ7rtzxV1N8IFA2JexBJ0XRvBYIVSVYnwmV8nErfBWQ5UgddHNkijjSk57z2-o6MR6ynpHDYXDP_JIrf4S7CFZwD6rjj7KTosGiBfg6ee4uWvqCtQflUZNPlNESi7tb7KPNT10Srt0O3bM3k6_lN42xuxQgo4-VhoHUcwbRJF0YhmSpcKaHlYot64ob7p4gdsudH4zQYOMaLQDibFXJAV1rbuRvm3AkvGz0s4GW6e-XA2ADQxHo3X11tkUnQJbazhyH-pOG&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NULL);
