INSERT INTO places VALUES(744,'本当は教えたくないセンス抜群なカフェ！ 📍EN TEA HOUSE 幻花亭 東京のチームラボ内にあるオシャレすぎるカフェ！ 施設内にあるけど中々見つからず隠れ家的カフェ☕️ ラテにはデジタルアートで花が咲いて、花々は中身のお茶がある限り無限に咲いてくる！その無限に広がる世界をそのまま飲むティーハウス。 月によって咲く花が変化するらしい！店内はかなり暗くて雰囲気も抜群！とてもお洒落で綺麗だったからぜひ行ってみて欲しい✨ ¥600 麦茶ライスミルクラテ(ICE) ¥600 焙じ茶カモミールライスミルクラテ(ICE) ¥700 凍結緑茶ココナッツ  ︎ ︎ ︎ ︎ ︎ ︎ ︎ ︎ ︎ ︎(緑茶とココナッツミルクのジェラート) ※別途チームラボ入館代がかかります。 【情報】  ・住所：東京都港区麻布台1-2-4 麻布台ヒルズ   ︎ ︎ ︎ ︎ ︎ ︎ ︎ ︎ ︎ ︎ ︎ ︎ ︎ ︎ガーデンプラザB B1Fチームラボ ボーダレス ・周辺駅：六本木一丁目駅 直結  ︎ ︎ ︎ ︎ ︎ ︎ ︎ ︎ ︎ ︎ ︎ ︎ ︎ ︎ ︎ ︎ ︎ ︎神谷町駅 直結 ・営業時間：10:00~21:00  ・定休日：チームラボに準ずる ・電話：03-6230-9666  #東京グルメ #東京カフェ #japantravel ',19900,517900,'gensen_gurume','["東京グルメ","東京カフェ","japantravel"]','https://m.tiktok.com/v/7432901899218717970','東京都港区麻布台1-2-4 麻布台ヒルズガーデンプラザB B1F チームラボ ボーダレス (六本木一丁目駅・神谷町駅直結)','EN TEA HOUSE 幻花亭','東京・六本木にあるチームラボボーダレス内にあるカフェ「EN TEA HOUSE 幻花亭」を紹介する投稿です。魔法使いのお店をコンセプトにした、幻想的な空間が特徴で、デジタルアートを用いたラテが提供されています。ラテアートの花は、お茶がなくなるまで咲き続ける演出がなされており、月ごとに咲く花が変化するようです。店内は暗めの落ち着いた雰囲気で、麦茶ライスミルクや焙じ茶カモミールライスミルク、凍結緑茶ココナッツなどのメニューが紹介されています。チームラボボーダレスへの入館料が別途必要です。',35.66206890000000129,139.7432670999999971,'2025-04-17T09:50:06.382+00:00','2025-04-18T03:05:47.084+00:00','Japan, 〒106-0041 Tokyo, Minato City, Toranomon, 5-chōme−9−９ Azabudai Hills Garden Plaza B, B1','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcLsT9amLZgDMts4V5am8g4YFXMjZ4Cc9y_SxhNHYQDgkznveY05hoWYAoGiI6mK2_Jb2SPJTbiNBzGoIHq3AIomPbqaX-H3q-8uH7hEZNnvIwZnCmgNTCrE_wBfu4arHVm7FUDRn5RifDFWNEEqMLa7j5pdveJQxeFAaPB7QKPJM7QdzRFont6PlCAc4mMFFjIegVgiFckx0ZS5lxkOuWEZghya1AUl9D6qtkMazSoXG-HpVgtOWf3wBYzmxW8yDm6zjuYVFSe41FunxEynTrtECUGO4RX7HOPiYbTK8wEyuEGjFmC09ufQNo3yFRLPqHJ2tLxNcM-imnm5f4SwGlppCKLFJ7KvFifsjl-MUiACPOy41OscDIB1phLmeu4QF_djxRvkYIN0aTCl8eBT762LjW-WNNeTaTAiI6oYN30HGIHkF8vaPC4xUBAto_d8XsRPDAu2UzL4Q8bnc3CjO8pVnGJDnBalg5vAPjoFk5nlhjF_Ig6OtyATtTXsbWSzYEigEhZYzXWAAbb6e2WJxOoP9s42U-nLQPBoejAAyIAHFXOUu4gjy9hHnlsJ5ZGpYSvSiZDcMxa9XtkVpWfQh4rDKvct4WV-shwJkGJp77sHPIk1tmufBubpoE_DXUyT&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NU