INSERT INTO places VALUES(751,'韓国・弘大(ホンデ)で 絶対に行くべきカフェ🥹💐 インパクト抜群なケーキやパンが　 並んでるところが圧巻✨🤎 クロワッサンの上のクリーは こぼれないようになっててすごい！　 生地自体がおいしいし、クリームも甘すぎないから意外とあっさり食べられちゃう🥐 上にクリームが乗ったダーティー&クリームはドリンク自体に甘さが入ってないから、とっても飲みやすい🤎🥛 絶対に一度は行くべき！ ［メニュー］ ◻︎ストロベリークロワッサン ◻︎ダーティー&抹茶クロワッサン ◻︎アイスダーティー&クリーム ◻︎アイスアメリカーノ ［店舗情報］ 店名　Antique coffee ヨンナム店 　　　（@antique__coffee） 住所　　　ソウル 麻浦区 東橋洞 113-3 営業時間　毎日10:00-22:00 定休日　　なし ⚠️営業時間等は変更になる可能性があるので、必ずお店のアカウントを確認してね🤲🏻 最寄駅　　弘大入口(ホンデイック)駅 　　　　　3番出口 徒歩7分 #韓国カフェ #ソウルカフェ #ソウルグルメ #韓国旅行 #韓国グルメ #渡韓 #ソウル旅行 ',17500,404200,'potapotasoup','["韓国カフェ","ソウルカフェ","ソウルグルメ","韓国旅行","韓国グルメ","渡韓","ソウル旅行"]','https://m.tiktok.com/v/7463785738103049480','ソウル市麻浦区東橋洞113-3 (弘大入口駅3番出口から徒歩7分)','Antique coffee ヨンナム店','韓国・ソウル弘大にあるカフェ「Antique coffee ヨンナム店」を紹介する投稿です。インパクトのあるケーキやパンが人気で、特にクロワッサンにクリームが乗ったメニューがおすすめとのこと。ストロベリークロワッサン、ダーティー＆抹茶クロワッサン、アイスダーティー＆クリーム、アイスアメリカーノなどが紹介されています。クリームがこぼれない工夫がされている点や、クリームの甘さが控えめである点が評価されています。営業時間は毎日10:00～22:00、定休日はなしです。ただし、営業時間は変更される可能性があるので、お店の公式アカウントを確認するよう推奨されています。',37.56210649999999874,126.9260459000000054,'2025-04-17T09:50:06.396+00:00','2025-04-18T03:05:50.045+00:00','24-5 Donggyo-ro 46-gil, Mapo-gu, Seoul, South Korea','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcL6i9_xlnVFlvb_bIIF8nzuMVHDzX5Zk32ZDBG_r59_jxlEimLVsxZTKAZRADSvtcLc8mqacEM2OPuSbaa-4WmbyADKjqNM8aJnL5ns3QFNs2n3XTeLJsU2DD52Wlwi_dr6BxrA5dTbEj9mNk5KoRxiw8er0sHMpyQs2hgjtXbCxBZ92QADQhS8hBV4416VZkCfboCXf74u923CmxzoZ8AvU18Bfn_zjjXZrHbbz5QCoNEWqK-nkrj7Gv3aS8a5SFtVOOJzHay6_DoihKeS2rdPY0xOvoSLH64F9sG3YUinxoMAOFLLGPcGKz_qpfipQD9qQqTaaJixQFDYO51qYJA3nARgIb08zgz30NSoIuxTCMZvHfr_EV6qzXNPAMP1U3sz6WM6Vmpn0pM9nLes201o4McIcIkgsrVzxRQ9wUF0JwWWuwWOji2lbxNmMChoTfi4bnJYLr7_Xf8oRsX3aK4uQ7Rh9DOmoFRICSzG4nylT83Xdh7ecJgOwuojMuUZN2tvdEyrO_v08kcJbeRd3lUff2wsypl8J7-AOUVy8J7109RLbvVpFyw2HrrW6wktMEQD9YWw6I0PH-IR6ayfd6O-_AADWyKCibb06ne0EScG2uEjrAMo5-c_GTexJHU6xtiti3Pp&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NULL);
