INSERT INTO places VALUES(760,'まるで絵本の中の世界 ゆったりした時が流れる自然あふれる古民家カフェ。 路地裏にひっそり佇むまるでジブリのような雰囲気が素敵。 人気のカツサンドは、肉厚ジューシーなカツが絶品でした。 3階は居心地抜群の屋根裏席と開放的なテラスを完備しています。 気になる人は保存して行ってみてね。 Like a world in a picture book  An old private house café full of nature where time passes leisurely.  The atmosphere is like something out of Ghibli, tucked away in a back alley.  The popular pork cutlet sandwiches are excellent, with thick, juicy cutlets.  The third floor has cozy attic seating and an open terrace.  If you are interested, save it and go there. ーーー店舗情報/store informationーーー 【neel】 📍: 東京都渋谷区神宮前2-19-2 🚃 : 原宿駅徒歩10分/外苑前駅徒歩10分/北参道駅徒歩10分 ⏰ : 10:00～20:30 📅 : 不定休 💰 :☀️¥1,000-¥1,999/🌃¥4,000-¥4,999 🛜 : ◯ 🔌 : ◯ 🤱 : ◯(ベビーカー入店可)※店内狭め/螺旋階段あり 🐕 : × 〜食べたもの〜 カツサンド¥1,140 ニールのヒレカツサンド¥1,250 ラフランスティ¥780 #原宿カフェ #原宿ランチ #原宿グルメ #外苑前カフェ #北参道カフェ',13400,296600,'masa_tarrace','["原宿カフェ","原宿ランチ","原宿グルメ","外苑前カフェ","北参道カフェ"]','https://m.tiktok.com/v/7398115530533588232','東京都渋谷区神宮前2-19-2 (原宿駅・外苑前駅・北参道駅から徒歩10分)','neel','原宿にある古民家カフェ「neel」を紹介する投稿です。絵本のような、ジブリの世界観を思わせる自然豊かな空間で、ゆったりとした時間が流れるカフェとして紹介されています。肉厚ジューシーなカツサンドが人気で、3階には屋根裏席とテラス席があるとのこと。営業時間は10:00～20:30、定休日は不定休です。価格帯、Wi-Fi、電源、ベビーカーの利用可否などの情報も記載されています。',35.6736620000000002,139.7107327999999882,'2025-04-17T09:50:06.416+00:00','2025-04-18T03:05:53.093+00:00','Japan, 〒150-0001 Tokyo, Shibuya, Jingūmae, 2-chōme−19−２ Ｂ－ＨＯＵＳＥ','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcLyDTQwu_RX2SSFglRnoTvkthPbQQFP51GilPHu4meq46bG3tFHJ4ynEplTO3rXOr6B15qeGTMxqn3LISQYBvRbFkTKsKBnOGkQgsGsObSa4XYW_2DXY0DzpIeUpPJMGCpwTy2NAr1UZErDbYpehmNqDwx5QMzZGUIbErz8hUid2Ha1PL15K4EvjxAQjYHIdfCur6a7WsQ3qnp0mcbmezquk0yX9mnX2AKDxHrbjuO-RKo6c6SQpNZLME6d2jtpH1esd60lgdtHohK3wnKDsIlSj-K5uYWFl1tWbrcbNSGLVUMBudb8hhkg5Pmj0N6lDQBzTQZOrio&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NULL);
