INSERT INTO places VALUES(830,'空中に浮かぶ大自然空中庭園カフェ 📍日比谷　【 DRAWING HOUSE OF HIBIYA 】 ミッドタウン日比谷6階にある空中庭園は開放感溢れる自然に囲まれた唯一無二の絶景空間 カフェのテラス席では、空中庭園を見ながら自然に癒される最高のスポット 店内席も天井が高く開放的でラグジュアリーな空間で、ゆったりとした時間を過ごせます。 和栗モンブランや太陽卵のこだわり焼きプリンも見た目も可愛く絶品でした！ 近くに映画館もあるので、デートや女子会にオススメの自然豊かな絶景カフェ☕️ 【店舗情報】 •店舗名: DRAWING HOUSE OF HIBIYA •アクセス: 日比谷駅から徒歩2分 •住所: 東京都千代田区有楽町1-1-2東京ミッドタウン日比谷6F •営業時間:11:00~22:00 #fyp #日比谷カフェ #東京カフェ ',1110,69300,'takuyajapanesefood0788','["fyp","日比谷カフェ","東京カフェ"]','https://m.tiktok.com/v/7418859252879543560','東京都千代田区有楽町1-1-2 東京ミッドタウン日比谷6F (日比谷駅から徒歩2分)','DRAWING HOUSE OF HIBIYA','東京ミッドタウン日比谷6階にある「DRAWING HOUSE OF HIBIYA」というカフェを紹介する投稿です。空中庭園に併設されたカフェで、開放的な空間と絶景が魅力です。テラス席からは空中庭園の景色を眺めながら、自然に癒やされるひとときを過ごせるとのこと。店内は天井が高くラグジュアリーな空間で、和栗モンブランや太陽卵のプリンなどのスイーツも提供されています。デートや女子会にもおすすめで、映画館が近くにあることもメリットとして挙げられています。営業時間は11:00～22:00です。',35.67369910000000032,139.7588756000000103,'2025-04-17T09:50:06.565+00:00','2025-04-18T03:06:16.781+00:00','Japan, 〒100-0066 Tokyo, Chiyoda City, Yūrakuchō, 1-chōme−1−２ 東京ミッドタウン日比谷 6F','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcKmU57nCLjOe0NF86OScr141YgLNI6CcBKnXlyX4SLBaHOcWvc2xbr_vsH0cyuHPWCBLKyFgYn1XoN3OAVxSB2kq-MoUr6oU-qz9aO6pEyTl4olDIxF1UeyLC9MDk_5hAhys7GpvTZ1aDbEwDEHl-00td0swei1rEu83M2NwG0Dwny7BQoeSaMqlcswZ42W9lan8Ewv0CvIiocJ8WVNzcCKdzRBf_TI0Qu31NyYlucL-7cuX7ed010rDKtCWlLvVrblPHBBb-O_peX1sKMi0C7e9lmgPLXFzle5hSu465NB69iiEeBM6M2Vb7ba12s3qzRgCtJ6SSY&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NULL);
