INSERT INTO places VALUES(838,'先日お邪魔させていただきましたBedford cafeが新しく運営されている前橋にオープンしたCHELSEA 7月のオープンから大人気でなかなかいけなかったのですがようやく機会がありお邪魔しました。 他の店舗さんでも大好きで食べていた牛すじの黒カレーを今回はミートボールプレートのカレーにセレクトしていただきました。プレートは彩り豊かでとても美味しくいただきました！ 食後のコーヒーも相変わらずバッチリで美味しくいただき、ゆったりとくつろげてとても癒されました！ 空間作りがBedfordさんはどこも素敵でホントに癒されます。 場所:CHELSEA by Bedford cafe 住所:〒371-0046 群馬県前橋市川原町１丁目５４−２８ 駐車場:専用駐車場有り TEL:027-888-6884 営業時間:11:30-15:30/ 17:30-23:00 定休日:無し ＵＲＬ:https://bedfordcafe.com/ #チルアウト #チルフォトグラフィー #チルスポット #chillout #chilltime #チルタイム　#群馬カフェ #群馬グルメ #群馬ランチ #群馬パスタ　#群馬カレー　 #チルカフェ東京 ',547,50300,'chill.out.spot5','["チルアウト","チルフォトグラフィー","チルスポット","chillout","chilltime","チルタイム","群馬カフェ","群馬グルメ","群馬ランチ","群馬パスタ","群馬カレー","チルカフェ東京"]','https://m.tiktok.com/v/7419647429189881095','群馬県前橋市川原町１丁目５４−２８','CHELSEA by Bedford cafe','群馬県前橋市にあるカフェ「CHELSEA by Bedford cafe」を紹介する投稿です。牛すじの黒カレーが人気で、今回はミートボールプレートのカレーを食べたとのこと。彩り豊かで美味しいと評されています。コーヒーも美味しく、ゆったりとくつろげる空間とのこと。専用駐車場があり、営業時間は11:30～15:30と17:30～23:00、定休日はなしです。',36.42712600000000122,139.0407256999999959,'2025-04-17T09:50:06.584+00:00','2025-04-18T03:06:19.938+00:00','Japan, 〒371-0046 Gunma, Maebashi, Kawaharamachi, 1-chōme−５４−２８','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcLCkS934SK_UGHWTDeHJKZTpGbh5mPcQVOndUWarFzlY9ln0n5u5LYG3m72UgsQDRwspG919oV6Na54ijL1LoGH5BeylJoT6S8TS4xd2SGeCqXEu4khh1uGZzL4wLlaRh_EB6Fib4enR5U5w4AS78L2LmfDWSkdQgvxS1W0wmSPOA1DiVCok993LVCt0O5ZQ4Dm6KUaovlF6N3lMkLVntkMGxEZnMKKZdS9srNiaCSahF1KgWnAHLBJ74_l1OFQ1KEnKAzOFB-dHJJkmmz9SfO5y56rMtZFok84Tn2QdrzQYL0Qhj-JANlnoecP4oWXj4pUzpQCC_A&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NULL);
