INSERT INTO places VALUES(896,'📍湯布院フローラルヴィレッジ / YUFUIN FLORAL VILLAGE 湯布院フローラルヴィレッジは、イギリスの街並みを再現したミニテーマパークです。まるでジブリの世界のような街並みが広がっており、至る所でジブリのグッズを購入することもできます。敷地内ではショッピングをしたり、動物と触れ合いながら楽しむことができます。由布院駅からも近く、湯布院旅行で立ち寄るのにオススメです🐈‍⬛ Yufuin Floral Village is a mini theme park that recreates the streets of England. The streets are reminiscent of the world of Ghibli, and you can buy Ghibli goods everywhere. You can enjoy shopping and interacting with animals on the premises. It is close to Yufuin Station, so it is recommended to stop by on your trip to Yufuin. < #湯布院フローラルビレッジ > 入場無料 〒879-5102 大分県由布市湯布院町川上１５０３−３ #japan #大分 #旅行スポット紹介 #oita #大分観光 #別府 #湯布院 #湯布院温泉 #yufuin #湯布院観光 #由布院 #yufuinfloralvillage #yufuinnomori #onsen #hotsprings  #traveljapan #visitjapan #温泉県 #ジブリ #ghibli  #温泉 #hotsprings #湯布院旅行 #海地獄 #温泉旅行 #トトロ #totoro',118000,2100000,'istudy_language','["湯布院フローラルビレッジ","japan","大分","旅行スポット紹介","oita","大分観光","別府","湯布院","湯布院温泉","yufuin","湯布院観光","由布院","yufuinfloralvillage","yufuinnomori","onsen","hotsprings","traveljapan","visitjapan","温泉県","ジブリ","ghibli","温泉","湯布院旅行","海地獄","温泉旅行","トトロ","totoro"]','https://m.tiktok.com/v/7462351049446214920','大分県由布市湯布院町川上１５０３−３ (由布院駅近く)','湯布院フローラルヴィレッジ','大分県由布市湯布院町にある「湯布院フローラルヴィレッジ」を紹介する投稿です。イギリスの街並みを再現したミニテーマパークで、ジブリの世界観を思わせるような雰囲気があると説明されています。ジブリグッズの販売や、動物との触れ合い、ショッピングなどが楽しめる施設で、入場無料です。由布院旅行の際に立ち寄ることを推奨しています。',33.26748709999999675,131.3655357000000094,'2025-04-17T10:05:14.518+00:00','2025-04-18T03:06:39.573+00:00','1503-3 Yufuinchō Kawakami, Yufu, Oita 879-5102, Japan','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcLsnl2PB1wkE9uIFMRGmHUL9rdgVVhLXlnOj6z_6-fQolb1_qXiXL1I1m2zjHBcS35FZtf-blbcDqTwgOFS9GHGn7PoTeYicuJywnbxKl0sDZcgitHzg3X4enGaF5qLO5Vr47ce0dzwWHXS5EpwyHqPNh6aOx6RhRnk6T1dULFvkwsdE6R_8tw6jH2ugVvaLYJndqPZuEOT_MyzMicLlje4OttW79WnZqboN5ORDNceIoMmfQsqtN53sLLF0kFqFUj9DY3BqBQBEcp97haZmhnD_aK6EloD3KxSU3zB3v9HpXyXquK9n6NhOVLzxnIo0ZapY1xEOLs&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wP