INSERT INTO places VALUES(908,'昨年の夏に旅行した、美しい夏の草原。 青海省の牧畜地区、毎年6月下旬から7月中旬までの期間は牛や羊の「移動シーズン」です。 同省海北チベット族自治州祁連県黙勒鎮の牧畜民は牛や羊を、冬季と春季の牧草地から夏季と秋季の牧草地に続々と移動させていて、数十キロに及ぶ移動の途中には、美しい草原と群れを成す牛や羊との独特の風景が目にできます。 青海省は標高の高いチベット高原に広がる人口の少ない広大な省、チベット文化やモンゴル文化の伝統が強く見られます。崑崙山脈に属する 6,282 m の高峰アムネマチンは、仏教の聖地になっています。青海省にある重要な仏教の僧院のひとつである五屯寺は、修道僧が綿や絹に描くタンカという仏画で知られています。 #中国青海省 #青海省 #中国　#中国旅行　#チベット高原  #Qinghaiprovince #China  #tibetanplateau ',93900,1900000,'djyoyo26','["中国青海省","青海省","中国","中国旅行","チベット高原","qinghaiprovince","china","tibetanplateau"]','https://m.tiktok.com/v/7326494020379757826','中国青海省 (海北チベット族自治州祁連県黙勒鎮周辺)','不明（青海省の牧畜地区）','中国青海省の牧畜地区の美しい草原風景を紹介する動画です。6月下旬から7月中旬にかけて行われる牛や羊の移動の様子が映し出されており、広大な草原と家畜の群れが織りなす独特の風景が紹介されています。青海省の地理的特徴やチベット文化、モンゴル文化についても触れられています。飲食店やカフェの情報は一切なく、観光地としての青海省の自然風景が中心となっています。料理やお店の雰囲気の説明はできません。',37.17031500000000221,100.3957309999999979,'2025-04-17T10:05:14.553+00:00','2025-04-18T02:56:14.360+00:00','59CW+47H, Gangca County, Haibei, Qinghai, China, 812301',NULL,NULL);
