INSERT INTO places VALUES(945,'4月6日まで200円引き！大人1人で1つでも、家族3人で1つでも作れる『巨大なしんちゃんのクッキー作り体験』がワクワクすぎる✨ . ＼10周年記念キャンペーン／ 📍ハグミュージアムの２階  . 今回体験してきたのは、クレヨンしんちゃんの巨大クッキー作り体験！ . なんと1枚3人までなら一緒に作ることができるんです！ . 体験には色んなお客さんがいて、お子様と2人で1つ、ベビーカーに乗った赤ちゃんと一緒に、友人2人で1つずつ、カップルで1つ、大人1人で利用など、とても楽しそうな雰囲気でした✨ . 店員さんの接客も丁寧で、居心地がとても良かったです☺️ . 所要時間は合計90分！ 作成30分+お渡しまで60分 . 「待ち時間どうしよう？」とその場で思いましたが、館内が想像以上に充実しててびっくり！ . 待ちの間で館内クイズ『オラの五感で体験ラリー！』ができて、全10問解答すればチョコビが貰えました！ . 他にもランチができるカフェや、子供の遊び場もあるので、 待ち時間を有意義に過ごせます✨ . 駐車場もあり、利用内容によって最大4時間も無料！ . 体験は事前予約不可なので「明日どこ行こ？」と迷った時にもオススメ👍 . 【 料金 】 ⚫︎4/6まで1つ1,800円 (以降1つ2,000円) . 平日　：随時開催 土日祝：10:30〜 11:30〜 13:30〜 14:30〜 15:30〜 . 【住所】大阪市西区千代崎3丁目南2番59号 【営業】10:00〜18:00 【定休】水曜日 【予約】不可 【最寄】ドーム前駅 徒歩約3分 【駐車】スーパービバホーム大阪ドームシティ店 . ⚠︎料金やサービス内容は変更となる可能性あるため、参考にする場合はお店の最新情報を随時ご確認ください。 . ┈┈┈┈┈┈┈┈┈┈ ┈┈┈┈┈┈┈┈┈┈ . いつもご視聴ありがとうございます＾＾ 大阪観光［公式］NEOトラベルです！ . \\ Q.どんな投稿してるの？ // ❶『大阪在住』の方へ✨ ❷『次の休日どこ行こ？』って迷った時に✨ ❸『近場で休日を楽しめるおでかけ情報』を発信中✨ ┈┈┈┈┈┈┈┈┈┈ ┈┈┈┈┈┈┈┈┈┈ . #休日を愉しむならNEOトラベル #大阪観光 ',39000,2200000,'osaka.neotravel','["休日を愉しむならneoトラベル","大阪観光"]','https://m.tiktok.com/v/7471412924767030546','大阪市西区千代崎3丁目南2番59号 (ドーム前駅徒歩約3分)','ハグミュージアム 2階','大阪市にあるハグミュージアムの2階で体験できる、巨大クレヨンしんちゃんクッキー作りを紹介する投稿です。1つのクッキーを最大3名で一緒に作ることができ、子供連れから大人まで楽しめる体験となっています。館内にはカフェや子供向けの遊び場もあり、クッキー作成の待ち時間にも利用できます。駐車場はスーパービバホーム大阪ドームシティ店と共用で、利用状況によって最大4時間無料です。料金は4月6日まで1800円(以降2000円)で、事前予約はできません。',34.66919419999999974,135.4785176999999977,'2025-04-17T10:05:14.650+00:00','2025-04-18T03:06:58.641+00:00','Japan, 〒550-0023 Osaka, Nishi Ward, Chiyozaki, 3-chōme−南２−南2 59号','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcKOTCUHL_hCXzvUK3xev17AT3KzDdbch8MDoVJbAsVkW8JaVN2007UrMrde0Uf8K6vstGpyojvcIlWAhSBNh6WPCygU1jTHBfOB8GenYjxUZcNP86gJ2o6gDQzGScl_5vzHlJr7FrJGJ9mV1TC8yRlbu3UlQvahtTcpiChb4taYbzjA9DMq37A4HcNTF-ovwF6BhCBB-53TbFP-AxeTd26uiSeMcK_M1Y3lCQPxJJeqfAMmCNqK_89MNYHJwZp11hlDtSypdGaWVq_OFWmI0aLwH1sDWGT9kju9gWMKh1_wte0EPIYloJTYQUOphMX8ESm001e_Vx6BzMSJgAGFjjCe7ivPryjw2OpaMNMWtdBolOiF-R_0LUsXspimXuOyMVQS_4TAHYEO