INSERT INTO places VALUES(954,'詳細はコチラ↓ この度もご視聴ありがとうございます😉✨ まるで鬼滅の刃の世界を味わえる【魚籠屋】を知っていますか？✨ このスポット、実はずっと行ってみたかったんです😤 (やっと行けた〜‼︎) このお店の自慢はなんといっても新鮮な魚料理‼︎ 動画では紹介してませんが、踊り食いもできる程、鮮度が高いんです！🫢 定食もボリューミーだし「鮎塩焼き」や「焼きおにぎり」は目の前の囲炉裏で焼く姿を見ることができます🔥 焼きおにぎりは魚の粉末を使用した特製の醤油を使用してるので格別でした🥹👏 スタッフの方々も本当に優しくて 愛されるお店ってこういうお店なんだなと感じました☺️ オススメなので是非、行ってみてくださいね！😆 【魚籠屋】 📍群馬県高崎市榛名山町360 #群馬グルメ  #魚籠屋  #群馬観光',32900,1500000,'date_spot_','["群馬グルメ","魚籠屋","群馬観光"]','https://m.tiktok.com/v/7454203468258037010','群馬県高崎市榛名山町360','魚籠屋','群馬県高崎市にある「魚籠屋」という飲食店を紹介する動画です。鬼滅の刃の世界観を思わせるような雰囲気のお店で、新鮮な魚料理が楽しめるようです。鮎の塩焼きや焼きおにぎりは囲炉裏で焼かれるなど、調理の様子も見られる演出がなされているようです。ボリュームのある定食や、魚の粉末を使った特製醤油を使った焼きおにぎりなども魅力として紹介されています。スタッフの対応も良かったとコメントされています。',36.44400830000000013,138.8433502000000032,'2025-04-17T10:05:14.670+00:00','2025-04-18T03:07:02.449+00:00','360 Harunasanmachi, Takasaki, Gunma 370-3341, Japan','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcJ0rNjehAcIUgRyTwBhmOXYOBu7mjAUcO9gd0WhasnxAvkwtKNYy0TIGjxuXxwNbbH1HpFiJEvV3uJq1r_Z_rqLxUp75ahcNapg7zsObczm0P487_z6P-SC54iyOsfx8GmEd8wz7tIIVwAlLMYbZbfV_84v8R2bqqtMWAlLpgtwf3Y7VDzaNIY_2qR6PFSrfPfuVBBlwvELhCmTVbI_ixFF-AwKM5whOIKZKhOAGOWvDWb26QR0behnxNxv2_Vovwt6Ox5_HanS6k0_MQQDrfm8iJztQNihB-O5OfI9PQulgEAphMcXvgUqOTvzuNnejlfuEYQUTQE&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NULL);
