INSERT INTO places VALUES(974,'📍この夏絶対行くべき絶景スポット3選 ①伊根の舟屋 京都 / Ine fishing village in Kyoto まるで海の上にお家が浮いてるみたいな不思議な街である伊根は、京都の北部にある『死ぬまでに絶対訪れるべき場所』付近にはコンビニもなく静かで穏やかな時間が流れています🍃是非この美しい光景を自分の目で確かめてみてください！ < #INECAFE > 〒626-0423 京都府与謝郡伊根町平田５９３番地１ 営業時間 11:00-17:00 ②白川郷 岐阜 / SHIRAKAWAGO in gifu 「#ひぐらしのなく頃に」の聖地としても有名な日本の世界遺産"白川郷"の夏は、合掌造り集落とひまわりのコントラストが日本らしくて美しい🌻 アニメに出てくるような景色がそのまま楽しめる白川郷でゆっくり時間を過ごしてみてはいかがですか？ < #白川郷 > 荻町城跡 展望台 〒501-5627 岐阜県大野郡白川村荻町 営業時間 9:30-15:30 / 入場料 : 無料  ③ 忍野八海 / Oshino Hakkai 富士山の雪解け水から成る池と日本の伝統的な街並みが融合した忍野八海からは、美しい富士山の絶景を拝むことができます。また深水8mの透き通った池で優雅に泳ぐニジマスに餌やりもできだけでなく、和菓子やお土産売り場も豊富で楽しめます🗻 < #忍野八海 > 〒401-0511 山梨県南都留郡忍野村忍草 入場料 : 無料 / 24時間営業 #japan #岐阜 #旅行スポット紹介 #gifu #reels #shirakawago #일본여행 #岐阜県観光 #岐阜観光 #ジブリ #traveljapan #visitjapan #白川郷 #白川郷展望台 #伊根の舟屋 #伊根 #summer #日本の夏 #ghibli #kyoto #kyototrip #mtfuji #ine #kyotojapan #忍野八海 #富士山 #oshinohakkai',20800,1000000,'istudy_language','["inecafe","ひぐらしのなく頃に","白川郷","忍野八海","japan","岐阜","旅行スポット紹介","gifu","reels","shirakawago","일본여행","岐阜県観光","岐阜観光","ジブリ","traveljapan","visitjapan","白川郷展望台","伊根の舟屋","伊根","summer","日本の夏","ghibli","kyoto","kyototrip","mtfuji","ine","kyotojapan","富士山","oshinohakkai"]','https://m.tiktok.com/v/7371453129218346248','京都府与謝郡伊根町、岐阜県大野郡白川村、山梨県南都留郡忍野村','INECAFE、白川郷、忍野八海','夏の旅行におすすめの絶景スポット3選を紹介する動画です。京都府の伊根の舟屋(INECAFE)、岐阜県の白川郷、山梨県の忍野八海の3ヶ所が紹介されています。伊根の舟屋は海上に家が建ち並ぶ独特の景観、白川郷は合掌造り集落の美しい風景、忍野八海は富士山と湧水池の美しいコントラストが魅力として挙げられています。各スポットへのアクセス方法や営業時間、入場料なども記載されています。飲食店やカフェの情報は、INECAFEについて営業時間のみ記載されている以外は含まれていません。',35.67391580000000318,135.290645000000012,'2025-04-17T10:05:14.716+00:00','2025-04-18T03:07:11.958+00:00','５９３番地１ Hirata, Ine, Yoza District, Kyoto 626-0424, Japan','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcI91ws03xjfdME4FP8sUxiT_O0Raf9l7NqhkuShZEn9NFMxOZSETVhOmukT180V9EJreqbdy46upIKJGsfGIW911QEGgS_-XfNKSxZ6KXeCqc6maSUFm979VAIhFJ6foBTcD7jhjZv8WNkkzFn7SoJeJHb1gIch-9CZlMKNKbwE8lNC2N3tfpnuDLrjkanxI5RfhxZJUbPyBcKX0kN8NCJgurRWNggK312iwm_wK_1OSaN1Epk625TZRBUzZ