INSERT INTO places VALUES(1048,'「世界一のおにぎり」と称される太郎さんのおにぎりが最高！ 【おにぎり太郎】 世界中から声がかかっているおにぎり職人で、厳選したお米と海苔で握ったおにぎりは何個でも食べたくなる美味しさ！ 香ばしい海苔と熱々なおにぎりに舌鼓を打つこと間違いなし！ お客さんに美味しいものを提供しよう！という情熱を感じる素敵な職人さんです🍙 今回は麻布十番にある「焼き鳥まつもと」とのコラボが実現 全国から銘柄鶏を厳選しており、絶妙な火入れで仕上げた焼き鳥は全体的にプリっとしておりジューシー！ 柔らかめな食感に焼き上げられていて万人が楽しみやすい焼き鳥を楽しめます！ おにぎり太郎さんは全国の飲食店とコラボしていて、予約をすればコースの中でおにぎり太郎さんが握るおにぎりを食べられます！ 予約状況や今後の活動はおにぎり太郎さんの公式アカウントから随時チェックできるので、こまめにチェックをオススメします！！ #東京グルメ #japanfood #tiktokfood #longervideos ',1300000,13000000,'muni_gurume_japan','["東京グルメ","japanfood","tiktokfood","longervideos"]','https://m.tiktok.com/v/7407800749138185488','麻布十番','焼き鳥まつもと','麻布十番にある焼き鳥屋さん。全国から厳選した銘柄鶏を使用し、絶妙な火入れでプリッとしたジューシーな焼き鳥を提供。柔らかな食感が特徴で、万人向けの味付け。おにぎり太郎とのコラボで、予約制のコース料理に「おにぎり太郎」のおにぎりが含まれる。',35.65345099999999689,139.7342869999999949,'2025-04-17T10:26:12.795+00:00','2025-04-18T03:07:37.667+00:00','Japan, 〒106-0045 Tokyo, Minato City, Azabujūban, 3-chōme−8−４ 麻布Ｋ’ｓビル 1F','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcI2ZzAIbuAwXrrcH9eZ8xLiyEY56etk2sqh93qFYkeMotyfswz6BWsJMQiSuWuIiGS5xuX0M9XxFYTLuMGssojARc1o3U6RGPwmL8lq_GQmrV71StTrjcAruyGSzl8D_IW0TMkjJmJhQuR6HSczjQ71m1CvAHvZKujCtd1d5U59jtMocdKfaCswxCEXPJxY2KPcLQdNDGA85KbqIILXCW4haTsek_QEs1OawW69kUXtISTssgcX6b5odfNo4e5VZxg1q0I0ToqqZNm-pGCoYu-pY31tDT0zeDUPQOisPy27v6WD1sklKo70zFS2uwOSoNmWPSQhhyw&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NULL);
