INSERT INTO places VALUES(1061,'東京で1番人気の究極の屋台ラーメン🍜 【しゅんやっちゃん】 東京八王子で大行列のできる屋台ラーメン。 昔懐かしい古き良き屋台と本格的な醤油ラーメンが虜になる。全国的にも珍しい屋台ラーメンだが恐らく日本で1番並ぶ人気店。食べたら思わず唸る究極のラーメンでした。 ぜひ食べてみてね。 ーーーーーーーーーーーーーーーーーーー 📍 東京都八王子市初沢町1277-8  🚃 高尾駅から徒歩3分 ⏰	18:00～23:00 🗓️ 日月定休日 💰 ラーメン750円 ーーーーーーーーーーーーーーーーーーー The most popular ultimate ramen stall in Tokyo 🍜 [Shun Yatchan] A ramen stall in Hachioji, Tokyo, where long lines form. You''ll be hooked on the nostalgic, good old stall and authentic soy sauce ramen. Ramen stalls are rare nationwide, but this is probably the most popular shop in Japan. It''s the ultimate ramen that will make you groan when you try it. Please give it a try. — 📍 1277-8 Hatsuzawa-cho, Hachioji-shi, Tokyo 🚃 3 minutes walk from Takao Station ⏰ 18:00-23:00 🗓️ Closed on Sundays and Mondays 💰 Ramen 750 yen — #東京グルメ #東京ラーメン#東京ディナー #八王子グルメ #ラーメン #東京観光 #japanfood #japantrip #tokyofood ',701600,7600000,'king_japanfood','["東京グルメ","東京ラーメン","東京ディナー","八王子グルメ","ラーメン","東京観光","japanfood","japantrip","tokyofood"]','https://m.tiktok.com/v/7474549322021866753','東京都八王子市初沢町','しゅんやっちゃん','東京都八王子市にある屋台ラーメン店。東京で最も人気のある屋台ラーメンとして紹介されており、大行列ができるほどの人気店。昔ながらの屋台風の雰囲気で、本格的な醤油ラーメンを提供。ラーメンは750円。高尾駅から徒歩3分、日・月曜定休、営業時間は18:00～23:00。',35.64141049999999922,139.2858319999999992,'2025-04-17T10:26:12.911+00:00','2025-04-18T03:07:40.787+00:00','1277-8 Hatsuzawamachi, Hachioji, Tokyo 193-0845, Japan','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcL2Zyg6IBboNogT7jSofn_vDye6NBc7TlL6GkzEAkxYkrNVMK95lmLTfziY4Zr5bZt2MZws4LB6buOeCHkpEqAy6mqklQbU_oOQpeaOnTU6u1Q-haTGm-xc8E2h1sauPSzb1Z_78o5cKp2NG6X3o_JWAHNTiuZuE_9az7x9u6biUJACyNc4AacDtXh-EBQcbbYpV16t9kdN6w3oZWEDb0ReptG3tvrUIrbeHBCCj0zHNe3tkClUrB1-xZjJhAhDT-5H1VgafcuHDskcOSfBte7hzHJWiaMYpU61AjCUVP5scAqyfKA6f_gHxExSRFOBEF1i6_1g7-UX2C8wMUmrk_InA7oAg_JgtLye7DvnI_p7dZbYTrykMEQ1i4e4BFJNx5GrdMxqcwE2TPKio3q56dWgauWcOvqNzGhbHCBOpg-R3R40SzwM-HKqQecQZOC-BN7XLt_N6Tg9FxrvkhhVSGD9sPL0NfSYznU-pkZ1HgnBeuAbJlHlcVy5bJzsBXKdENgQAaob_tOviDJ4g1Atr0L2KRq6nmYWvUiAA