INSERT INTO places VALUES(1113,'丸ごとイイダコの衝撃！旨み爆発の贅沢たこ焼きが最高！ 店名：沖縄イイダコ屋 最寄り駅：新鳥栖駅（佐賀） 普通のたこ焼きよりも弾力があり噛むとタコの旨みが広がるのが魅力！ 丸ごと1匹入っているので食べごたえがあり出汁の風味とも相性抜群でした！ 食感がしっかりしているのでプリプリ食感が好きな人にはおすすめ！ イイダコ炙りたこ焼きは5個990円でした！ ソース、もずくソース、マヨネーズは無料！ 明太マヨは＋100円でした！ 住所：佐賀県鳥栖市蔵上4-120 新鳥栖 道の市場 最寄り駅：新鳥栖駅から徒歩12分 営業時間：11時から21時 定休日：水曜日 Marugoto Iidako Shock! The Ultimate Takoyaki with an Explosion of Umami Store Name: Okinawa Iidako-ya Nearest Station: Shin-Tosu Station (Saga) Unlike regular takoyaki, this one has a firm texture, and when you bite into it, the rich flavor of the octopus spreads in your mouth. Since a whole baby octopus is inside, it’s very satisfying and pairs perfectly with the dashi-flavored batter. If you love a chewy and bouncy texture, this is a must-try! The grilled Iidako takoyaki costs 990 yen for 5 pieces. Sauce, mozuku sauce, and mayonnaise are free! Mentaiko mayo is available for an additional 100 yen. Address: 4-120 Kuranoe, Tosu City, Saga Prefecture Located inside Shin-Tosu Michi no Ichiba Nearest Station: 12-minute walk from Shin-Tosu Station Business Hours: 11:00 AM – 9:00 PM Closed on Wednesdays #佐賀グルメ #takoyaki #japanesefood ',120500,3900000,'harapeko_jpn','["佐賀グルメ","takoyaki","japanesefood"]','https://m.tiktok.com/v/7471977351690194183','佐賀県鳥栖市蔵上 (新鳥栖道の市場内)','沖縄イイダコ屋','佐賀県鳥栖市にある、新鳥栖道の市場内にあるお店。丸ごと1匹のイイダコが入ったたこ焼きが特徴。弾力のある食感で、タコの旨みが口の中に広がる。だしとの相性も良く、食べ応え十分。5個で990円。ソース、もずくソース、マヨネーズは無料、明太マヨは＋100円。営業時間は11時～21時、水曜定休。新鳥栖駅から徒歩12分。',33.37286339999999996,130.4980965999999967,'2025-04-17T10:26:13.050+00:00','2025-04-18T03:07:59.568+00:00','Japan, 〒841-0056 Saga, Tosu, Kuranoue, 4-chōme−１２０ 新鳥栖道の市場内','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcLgSHPWvWJSsFz_kyc0_gGnOB6914NdnXcuTtOno8ZQ5Bh1qXn2FhNMEflXA9G0qAHei9V05AoNkA2emv-fVzcsPguvYJWrZm-yjtzg8SDuHnsvTnBltBdD5SGqdeHKE0Y0m9AbnHB0NBDDT7QgVzLkSKaJKQN9uzrkLPMVAy5kuDjHHRFSpJOrmeV2xtJ7gvcs0jXxtQ4AmMlG3c9ovj2yZUwY1CPW0ucSgP9ryD6TLb2nWf9R4hcP5Wo1flBgrSJRCv-KQXP1DyQn4e4yugc-FQbmvGk24tpiHTlG