INSERT INTO places VALUES(1118,'【東京・銀座】分厚さ日本一!?600g超え破壊力抜群のカツ丼！ 【店名 (Store Name)】 銀座 とんかつ丸七 Tonkatsu Marushichi Ginza 【場所 (Location)】 東京都中央区銀座4-13-3 4-13-3 Ginza, Chuo-ku, Tokyo 【メニュー (Menu)】 焼きカツ丼 極厚 ¥3,500 (税込) Yaki Katsu-don Gokuatsu ¥3,500 (tax included) 【感想 (Food Report)】 今回ご紹介するのは、銀座にある「とんかつ丸七」さんの超極厚カツ丼！ なんと、まる1日かけて低温調理したリブロースを600g以上の塊にカットし、じっくり揚げた圧巻のトンカツが丼の上に堂々と鎮座！ 甘めのタレがたっぷりかかり、その下にはとろっとろの半熟卵が広がる贅沢な仕上がり✨ 極厚なのに、お箸ですっと切れるほど柔らかく、旨味と脂の甘みが口の中でとろける絶品です🤤 カツを卵でとじないことで、衣のサクサク感と半熟卵のとろふわ感を最後まで楽しめるこだわりの一杯！見た目のインパクトだけでなく、味も格別でした💯 ちなみに、この600gの極厚カツ丼は不定期販売なので、販売日はお店の公式アカウントをチェックしてみてください！ Today, we’re introducing an incredible ultra-thick katsudon from Tonkatsu Marushichi in Ginza! This masterpiece features a massive 600g+ chunk of low-temperature-cooked rib roast, carefully prepared over an entire day before being deep-fried to perfection. Sitting proudly atop the bowl, this tonkatsu is truly a sight to behold! The cutlet is generously coated in a sweet sauce, with a bed of rich, runny soft-boiled eggs underneath for an indulgent finish. Despite its thickness, the meat is unbelievably tender—you can easily cut through it with chopsticks—melting in your mouth with its rich umami and sweet, flavorful fat. 🤤 By not simmering the cutlet in egg, this dish preserves both the crispy texture of the coating and the fluffy creaminess of the soft-boiled egg until the very last bite. It’s not just visually stunning; the taste is on another level! 💯 Just a heads-up—this 600g ultra-thick katsudon is only available on a limited basis, so be sure to check the restaurant’s official account for sale dates! #トンカツ #銀座グルメ #銀座ランチ #とんかつ丸七 #東京グルメ #ginza #tonkatsu #tokyofood #japanesefood ',114200,2600000,'joy_meshi_japan','["トンカツ","銀座グルメ","銀座ランチ","とんかつ丸七","東京グルメ","ginza","tonkatsu","tokyofood","japanesefood"]','https://m.tiktok.com/v/7470826034384981256','東京都中央区銀座','銀座 とんかつ丸七','銀座にあるとんかつ屋さん。600gを超える極厚の焼きカツ丼が特徴。1日かけて低温調理されたリブロースを使用し、甘めのタレと半熟卵との組み合わせが絶品とされている。衣のサクサク感と半熟卵のとろふわ感を同時に楽しめるよう、カツを卵でとじていない点がポイント。価格は3500円。販売は不定期。',35.66963890000000247,139.7690948000000048,'2025-04-17T10:26:13.061+00:00','2025-04-18T03:08:00.819+00:00','4-chōme-13-3 Ginza, Chuo City, Tokyo 104-0061, Japan','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcJlVltHYGT7_S75T5CXG9SBpBoLr5XBFYXn84XePRnAYFwp6wp7RESFmH3UuGhVVOyoMvbgcxlKPbdinByMkAVJB95Wn7jrJMrU2IMc-LV9dB1en4cRVEbNVx67g31Bt6aOcd9hbqM0iSXqBRhXVljFoE7rNldzxJ3Ll_NJzLO-4GbQ-qB5ovduhNTxZ-SfBh0xCwcl7LwOjV_fy4QVQt5A20PMNE6ODQ6QVkaULrHsH4-RNorcw2P0Y9a1ZJjVPdSNeWrYc8vVgQaA8tEpeQZH07ezTT7J-u2U6C2BgUXndUEN1X6Rh0JZTn1SKxpMTDvmhBaCxWjb8Pwxv_ncMtBoz8OexWhUA26AL_5MF3zU8665OmXG3lmBKExd-dwrf-cRBBDJ0qFfh6cWwYzz9Xl-ydw85EGRtQcFjNdcSXXmq3XdrgtZhnzBFEa2O3UoW1WqWNuHADJwwKf6gJixDMCLFjkLtU-zexUhky2uiRHwrZIJmGgK5fQq35UVk-xxy99UDcY4OsSa7QQlo9WRHKAXmOjleShOr5m2sVJGEpHxckMUpKEydPbjToSSe4tnFVW-LVNxoLf9HC3-T_Xw-RjqruqlYGofrZKoZiBfLudk8IhD_GxDbz2-sLZOO1XN1F1SvFDb&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NULL);
INSERT INTO places VALUES(1119,'創業100年の老舗が作る究極の玉子焼き 店名：つきぢ松露 最寄り駅：築地市場駅（東京） 職人さんが1枚ずつ丁寧に焼き上げていく玉子焼きは焼き目は綺麗で形は完璧！ フワッフワで噛むと中の出汁をジュワッと感じれます！ 梅やしらす、ベーコンチーズなど種類も豊富で楽しめました！ 卵サンド700円 たまご串3本セットは500円でした！ 住所：東京都中央区築地4-13-13  最寄り駅：築地市場駅から徒歩5分 営業時間：4時から15時 定休日：不定休 The ultimate tamagoyaki made by a 100-year-old long-established store Store name: Tsukiji Matsuro Nearest station: Tsukiji Market Station (Tokyo) The tamagoyaki is carefully cooked by a craftsman one by one, with beautiful browning and a perfect shape! It''s fluffy and you can feel the broth inside when you bite into it! We enjoyed the wide variety of flavors, including plum, shirasu, and bacon cheese! Egg sandwich was 700 yen and a set of 3 egg skewers was 500 yen! Address: 4-13-13 Tsukiji, Chuo-ku, Tokyo Nearest station: 5 minutes walk from Tsukiji Market Station Opening hours: 4:00 to 15:00 Closed: Irregular holidays #japanesefood #tiktokfood #longervideos ',111700,6700000,'harapeko_jpn','["japanesefood","tiktokfood","longervideos"]','https://m.tiktok.com/v/7390320398115605780','東京都中央区築地','つきぢ松露','築地市場駅から徒歩5分にある、創業100年の老舗のお店。職人が丁寧に焼き上げた、焼き目が美しく形も完璧なふわふわの玉子焼きが特徴。出汁の風味豊かな玉子焼きは、梅、しらす、ベーコンチーズなど様々な種類があり、卵サンド(700円)やたまご串3本セット(500円)などが提供されている。営業時間は4時～15時、不定休。',35.66507010000000121,139.7702169000000083,'2025-04-17T10:26:13.065+00:00','2025-04-18T03:08:01.212+00:00','4-chōme-13-13 Tsukiji, Chuo City, Tokyo 104-0045, Japan','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcK3VCorLg-xu3MA-UGADUD2pgrrS6tSlEJILzV-nPdOPzju4RfviG0ogc379Y5h2nIgOP7xpZkJ2CuuWAEnE8YWXvsbv_37eL3hYr-n_NKaOqpUesUIK3sT73YaIj0PAOt_cSDzRiJChFnW9X4mJkaU2ndzhSUvwdQYuH0nHHVuQ-RAeObkJ38fGAWcah6TUfzbyKLnCSPZ4w3oDUvqZ2heDrWR7Xgkwpyr2gFYodY24LWYKpClOkzMKMA9LQXpF6wxnuKAp4jJwry7rHSrshTdOnP0b4JmhRPlgK_yOTqeX1cM8e1FGRa5voPQX-FYrIXZWY6F8Nc&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NULL);
