INSERT INTO places VALUES(1125,'大阪は扇町のカリじゅわクロワッサン🥐 嵜本ベーカリーandmore扇町店では、はちみつバターを染み込ませた「ハニークロワッサン」が人気🍯 クロワッサンの良さも残しつつ、はちみつバターと砂糖がキャラメリゼされた、背徳の味わいでおすすめ🤤 1個：220円 Crispy and juicy croissants from Ogimachi, Osaka 🥐 At Sakimoto Bakery andmore Ogimachi store, the "honey croissant" soaked in honey butter is popular 🍯 While retaining the good qualities of a croissant, it has a sinful taste with honey butter and caramelized sugar 🤤 1piece：220yen 📍嵜本ベーカリーandmore 扇町店 🏠 大阪府大阪市北区天神橋３丁目７−１３ ブラーヴォ扇町 1F Osaka Prefecture, Osaka City, Kita Ward, Tenjinbashi 3-7-13 Bravo Ogimachi 1F ⏱8:00~19:00 ⚠️商品が揃うのは大体10時から 📞予約可 #大阪グルメ #大阪スイーツ #大阪パン屋 #クロワッサン #梅田グルメ ',95800,2600000,'sakimotobakery','["大阪グルメ","大阪スイーツ","大阪パン屋","クロワッサン","梅田グルメ"]','https://m.tiktok.com/v/7465627936754863366','大阪市北区扇町','嵜本ベーカリーandmore 扇町店','大阪市北区扇町にあるベーカリー。はちみつバターを染み込ませたハニークロワッサンが人気商品。サクサクとジューシーな食感が特徴で、はちみつバターと砂糖のキャラメリゼされた甘さが魅力。価格は1個220円。営業時間は8:00～19:00だが、商品は10時頃から揃うとのこと。予約も可能。',34.70130609999999649,135.5110781999999858,'2025-04-17T10:26:13.080+00:00','2025-04-18T03:08:03.053+00:00','Japan, 〒530-0041 Osaka, Kita Ward, Tenjinbashi, 3-chōme−7−１３ ブラーヴォ扇町 1F','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcLQa2U2bTcsmJjv2NPZGHnVxmjXJRfZxt79R8nDpITDzv_zFGrYFL43jiOPow7zirLEvwcE-y2MDDroN9y9NBqqC0YidqyozNuoOKprAKNebgTqHXNBhev705hqMfgBUq7b6t19evc1BJyvNvb6oRRWpL-c0W8Fn4VLlN_AfJsD2B0vTNTkvsGScqTEhYDaJwMvn077tf325pVXhyr1n6guDx-2tB8QbNvT4bTgWhNaeymEwloo7ecJw2npmXn0rL_f_hEhcluQjnBujwHv8mooxhEtCgrfrCXjfkPoj0Lw4uerldXZPPOCZ8TNmsjf1cooJcVsC30&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NULL);
INSERT INTO places VALUES(1126,'50年以上続く老舗のカツ丼が最高！ 店名：やぐら 最寄り駅：博多駅（福岡） 卵に味がしっかりと染み込んでいてサクサクのトンカツとの相性は抜群！ 上の卵黄を崩すと濃厚でまろやかな風味が丼ぶり全体を包み込みます！ 特製カツ丼定食(ミニうどん付)は1000円でした！ 住所：福岡県福岡市博多区博多駅前2丁目9-28 福岡商工会議所ビル食堂街（地下一階） 最寄り駅：博多駅から徒歩10分 営業時間：11時半から19時 定休日：日曜祝日 The katsudon from this long-established restaurant that has been around for over 50 years is the best! Store name: Yagura Nearest station: Hakata Station (Fukuoka) The flavor is thoroughly infused into the egg, making it a perfect match with the crispy tonkatsu! When you break the egg yolk on top, a rich, mellow flavor envelops the entire bowl! The special katsudon set meal (with mini udon) was 1,000 yen! Address: Fukuoka Chamber of Commerce and Industry Building Shokudo-gai (first basement floor), 2-9-28 Hakataekimae, Hakata-ku, Fukuoka City, Fukuoka Prefecture Nearest station: 10 minutes on foot from Hakata Station Opening hours: 11:30 to 19:00 Closed: Sundays and public holidays #japanesefood #tiktokfood #katsudon ',95800,915300,'harapeko_jpn','["japanesefood","tiktokfood","katsudon"]','https://m.tiktok.com/v/7408528138231106836','福岡市博多区博多駅前','やぐら','福岡市博多区博多駅前にある、50年以上続く老舗の食堂。味がしっかり染み込んだ卵とサクサクのトンカツが特徴のカツ丼が人気。卵黄を崩すと濃厚でまろやかな風味が広がる。特製カツ丼定食（ミニうどん付き）は1000円。営業時間は11時30分～19時、日曜・祝日休み。博多駅から徒歩10分。',33.59164119999999798,130.4144599999999912,'2025-04-17T10:26:13.083+00:00','2025-04-18T03:08:03.480+00:00','2-chōme-9-28 Hakata Ekimae, Hakata Ward, Fukuoka, 812-0011, Japan','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcIF8dSgR0aCz-Z9MJxGECveHsmAGw76nExf1wwjvPmR2C2g6_89nkGz7EsCYW93Cb6K_KLChAjeu6z-vX_CqrZwYlPfcFqazxwlK1yCktcaSdkL_6Euy-uAEPIwxOliSxpbzbTAIbdKdWPlCK3gcuYUwCowSs1Z5OncWfDR_kqH4h_mC1nUzYLcpqa7SUvG6f87yymIoCPwTEkQ8LHe5dpz7vjMD_mvnaGPLw9FCZER_nNS2dx54a4J7ucxT-vp983Hpjwk3JFILWvgbn0YQR7hOSrZtC9WgatpPNYZ0zFYbBQS3eYsX9XcX37JLyRrRleE8WGr8MmKBb2LnaJRhn9sR47xwZJBvxj2k7i_oxRSYYeiMU4PP9zWOwKGYT_ySO4hmeUfIktoDM9asvYjCg7Y1KwkiCOeyb9VbShTrvNbj2S2M7iAVkINM732YlRspPBp3voDzJ5SthhiHuoTH8GMrwh3au_Oen7kcaJktN3