INSERT INTO places VALUES(1127,'残したら出禁⁈横浜の有名店『豊野丼』 この日はランチ後のおやつに 豊野丼が食べたくなったものの 出禁になりたくないので 黄金丼ライス少なめとしじみ汁をオーダー。 ぶっきらぼうな言い方だけど 細部まで優しさに溢れてる大将。 『このくらいで平気？』 『ティッシュも上にあるからな』 『ゴミ箱は後ろだよ』 『ご飯足りなかったら言いな〜』 『足りた？』 絶え間なくお客さんが並んでいて 忙しいのに最後まで優しいお気遣いに感動！ 肝心の天丼は秘伝のタレなのかめっちゃ美味しい！ サクッとワイルドに揚げられた天ぷらも タレがしみしみ過ぎず熱々で絶品。 一度はぜひ。 【豊野丼】 阪東橋駅より3分 045-251-4740 神奈川県横浜市南区真金町2-18  #神奈川グルメ #横浜グルメ #阪東橋 ',95500,3200000,'kanagawa_food','["神奈川グルメ","横浜グルメ","阪東橋"]','https://m.tiktok.com/v/7428588567133179152','神奈川県横浜市南区真金町','豊野丼','横浜市南区にある天丼屋さん。食べ残しは出禁というルールがあることで有名。店主はぶっきらぼうな言葉遣いながらも、細やかな気配りをする人物として紹介されている。秘伝のタレで味付けされた天丼は、サクサクの天ぷらとタレのバランスが良く、非常に美味しいと評価されている。阪東橋駅から徒歩3分。電話番号は045-251-4740。',35.43839650000000319,139.6275823000000002,'2025-04-17T10:26:13.085+00:00','2025-04-18T03:08:03.875+00:00','2-chōme-18 Maganechō, Minami Ward, Yokohama, Kanagawa 232-0021, Japan','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcIjMkXLyS2MVW2efPvx3Y4JMB46TO-gB0M6C7Ib823jUR9uioUHVelAxuYbvDnWQMIISEgxli9k1QnCo3kZMRxhCC_ex0c1p9jBgCuruDqY7UiytJZIr__uAhOVHcgpZDPJROiGAG1BVrFUrlucGW6KwZgGnXII0t-W6nr47oKlWnv0e5ujFvXUHVDPK2sx5QvWqrlkPRZnM-zA96Mm1GzN12fyXMrCI99Tly1teFVS30lSY7dFBDcB7q5OgZXGkyRnbCAD5I7IoEV8yfytYKzhukaCHNDgKrBK78A1FWqNaoy0J8MmjTj-HSRH8dX3m2WS4jWC2bRWZRif0c17E7YMvWXRRXAGUyXENoo3hXIDzPS-31tIerMmgDvfOJJzzROgxv0zo-b0-KXOUe5BvyYAsVjKyxygrnkL28YN3B_fke141QV-CmAr9e81PwjfjRFQyZwumhGkyHY4MZhUEV36xkW5A0k97QjWb71cpL7XHVWRYZ-6-rVijSUIXlEtNaMJr-17yVFciA8dKIUHevqrkzat7VYPXRe7d33G9FH6U6N__UvAcKzlZ11IC0eX3oWYjFaTfO66dzrM8rfcS0DRh90MfNS_lKHxtaDn-BG_OvkntxSWQHevoEHuSAo13r8WkVGZ&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NULL);
