INSERT INTO places VALUES(1142,'《東京で1番美味しい釜玉めんたいうどん(The most delicious mentaikamatama udon in Tokyo)》 【店名(StoreName)】 うどん屋 新堀  Udon restaurant Shinbori 【場所(Place)】 東京都 代々木 Morpho 1F, 5-23-9 Sendagaya, Shibuya-ku, Tokyo	 【メニュー(Menu)】 釜玉めんたい＋バター＋パルメザンチーズ(Kamatama Mentai + Butter + Parmesan Cheese) ¥1,300 釜玉めんたい＋バター＋有明のり(Kamatama Mentai + Butter + Ariake Nori) ¥1,300 【その他詳細(OtherInfomation)】 今日ご紹介するのは東京の代々木にある「新堀」！ もちもち食感の福岡うどんが最高！明太・バター・卵黄を混ぜて食べると超絶品！東京で1番おすすめしたいうどん屋さんかも！おすすめ！ Today we will be introducing “Shinbori” in Yoyogi, Tokyo! Fukuoka udon with a chewy texture is the best! It''s super delicious when you mix pollack, butter, and egg yolk! This might be the most recommended udon restaurant in Tokyo! recommendation! #tokyofood #japanesefood #tiktokfood ',73000,1100000,'gourmet_uni_japan_','["tokyofood","japanesefood","tiktokfood"]','https://m.tiktok.com/v/7321327517695085826','東京都渋谷区千駄ヶ谷','うどん屋 新堀','東京都渋谷区千駄ヶ谷にあるうどん屋さん。もちもちとした食感の福岡うどんが特徴。明太子、バター、卵黄を混ぜて食べる釜玉めんたいうどんがおすすめで、東京で1番美味しい釜玉めんたいうどんと紹介されている。価格は1300円(バター、パルメザンチーズまたは有明海苔付き)。',35.68403969999999959,139.7035625000000038,'2025-04-17T10:26:13.122+00:00','2025-04-18T03:08:10.016+00:00','Japan, 〒151-0051 Tokyo, Shibuya, Sendagaya, 5-chōme−23−９ モルフォ 1F','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcIBTgDziLXd6MzwWAIl--oRfIXUrlqxDu8cwDbTLjpwLOlqAiVw6Xaw4O90Of1aj_wxEs8WDywS6cZnz99OxxK8t8t_h_1WK_L-EbiSIAxlyEavuhMqjt8QP6qgIUGUdp9JEGBFDz9t52gPx2QHZ6Xf7cF6t2TIFhOjOxdiS7O0aH4l5Nze_FO8Y6KNOqVcFy93UpgId8BfVXOyCAvbEtcgqwY30IVLko7LoF_IMz-hInjDcb-haqdjQNW85HxQY-os0cUh5LEaSB5oanTxfi0xsjsNjfmxVBaPoLohCvYvN4kJg93daFJgpbmeeCO6K3uXXUk43RQ&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NULL);
