INSERT INTO places VALUES(1151,'肉を焼かない焼肉「焼きうお」が最高！ 店名：焼うおいし川  六本木凛華楼 最寄り駅：六本木駅（東京） 新鮮な魚を焼肉のように炙って食べられるお店の3食丼は濃厚なウニといくらを丼の上にふんだんに敷き詰め厚切りの炙った大トロが豪華にのった一品！ 濃厚で甘い雲丹といくら、炙った大トロの脂　 が混ざり合い相性抜群でした！ 刺身や焼きうお盛り合わせなどの至福の三色コースは15000円でした！ 住所：東京都港区六本木6-2-6 GEMS六本木 5F 最寄り駅：六本木駅から徒歩4分 営業時間：17時から24時 定休日：不定休 The best yakiniku (grilled fish) is the yakiniku (grilled meat) that doesn''t involve grilling the meat! Store name: Yakiu Oishikawa Roppongi Rinkarou Nearest station: Roppongi Station (Tokyo) The three-course bowl at this restaurant where you can eat fresh fish quickly grilled like yakiniku is a luxurious dish with a generous amount of rich sea urchin and salmon roe on top of the bowl and thickly grilled fatty tuna on top! The rich and sweet sea urchin, salmon roe, and grilled fatty tuna blended together perfectly! The blissful three-course meal, which includes sashimi and grilled fish platter, was 15,000 yen! Address: 5F GEMS Roppongi, 6-2-6 Roppongi, Minato-ku, Tokyo Nearest station: 4 minutes on foot from Roppongi Station Opening hours: 5:00 p.m. to midnight Closed: Irregular holidays #東京グルメ #japan #japanesefood ',61300,3600000,'harapeko_jpn','["東京グルメ","japan","japanesefood"]','https://m.tiktok.com/v/7453039806956801287','東京都港区六本木','焼うおいし川 六本木凛華楼','六本木にあるお店で、魚介を炙って食べる「焼きうお」が特徴。新鮮な魚介を焼肉のように炙って提供するスタイルで、ウニ、イクラ、炙り大トロが乗った3種丼(価格不明)や、刺身、焼き魚盛り合わせなどが含まれる三色コース(15000円)が紹介されている。GEMS六本木5Fに位置し、六本木駅から徒歩4分、17時～24時営業、不定休。',35.66206420000000322,139.7308380000000056,'2025-04-17T10:26:13.141+00:00','2025-04-18T03:08:12.584+00:00','Japan, 〒106-0032 Tokyo, Minato City, Roppongi, 6-chōme−2−５ GEMS六本木 5F','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcIF99_ZqUaSBvvEs60pKJx6CEWwNnXJWcwVNEF3RbvcJCv0pEA4FNZ9KRTf8I_I9Vy5PBoaD5dSxHwKhRsK_SG_7Yir-ISj5WqsTPfz3gBDP1n9pwsTh8a0PdKWZMMsxhRj2Ns-zTUPSnNLSn8ujBmnFVWW7Z9CD1AdRC5V_A4v6Y5rxXlWrSLOYp0qA9Xg8duBYnPPHwbnGcgHVROHb8VfFeKwQXyhYgWGhGdvW7tNBn1HPczChvVo7zwew8SwWC3ub46FRypATp0yoll8a8hxjNptr_-v6syMMrTPulyqAVFZIvbvLyMmYKh7Yp5