INSERT INTO places VALUES(1161,'国内最高の馬刺しともつ焼きが食べれる名店『まるい』！ @wolf.0313 で行きたいお店を参考にしてね！ ⁡ 【押上　もつ焼きまるい】 ⁡ 東京屈指のもつ焼きと馬刺しの名店！🐺 言わずとしれた予約困難店のお店 今までの馬刺しやもつ焼きの概念を変えてくれる 注文は一度きり 二度目も可能な時はあるが、一度でなるべく注文すること 絶対に食べるべき馬刺しは分厚いのにめちゃくちゃ柔らかい 臭みがなく、こんなに馬肉って美味いのかと驚かされる レバーたれ焼きも必ず頼んでほしい 焼いてるがパサつきがなく、とてもしっとり 秘伝のタレが絶妙 他にも白、タン、にんにくホイル焼き、牛煮込みなどを注文！ 漬物はなんとぬか床200年のものを使ってるらしい 大将がとても気さくでギャグ好き カウンターで話しながら食べるのがよい この間行った時はいなかったから、体調悪かったのかな、、心配 奥さんと息子さんもいるんだけど、お二人だけだと少し接客ドライに感じるかも 少人数でたくさんのお客さんの注文を捌くから時間に余裕を持って、わくわくしながら楽しもう！ ごちそうさまでした🐺 🚃押上駅　徒歩7分 💺30席 📍 東京都墨田区業平3-1-1   ⏰ 月・火・水・木・金・土 17:00 - 22:00 定休日:日 #東京グルメ #浅草グルメ ',52100,2500000,'wolf.0313','["東京グルメ","浅草グルメ"]','https://m.tiktok.com/v/7454848814273334535','東京都墨田区業平','もつ焼きまるい','押上駅から徒歩7分にあるもつ焼きと馬刺しが評判のお店。予約困難な人気店とされている。特に馬刺しは分厚く柔らかく、臭みがなく美味しいと高評価。レバーたれ焼きもおすすめ。秘伝のタレや200年もののぬか漬けなど、こだわりの食材を使用。大将は気さくで、カウンター席で会話を楽しみながら食事ができる。混雑しているので時間に余裕を持って行くのが良い。',35.70565200000000061,139.8128930000000025,'2025-04-17T10:26:13.166+00:00','2025-04-18T03:08:15.656+00:00','3-chōme-1-1 Narihira, Sumida City, Tokyo 130-0002, Japan','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcKfGMkDTj52f2TEeG2_tONKMW9CK6YKVxJlT1VdT_WrnGozptgllejW_XQ5sUYfdeGlQ30A55d2zJeQbkoeKtR8MS0Zgh_YGZGdiuKoJzRrQD0MZX1xFHFXStG70w4G8mbSB-hoHgzermwlWa8KLFkuBW_DbiJXS_UobXCNTXyfZgkvThIhhBGuH2esaJHL1RBLk2hTKrzMPX5EjBIYTyq01o_TXCraAn6L-Hnnf8LzZ2H4p0OvMC6_WbJT5jMMaxnBcqs7RwM_1b13usGc5krmeV1pvXRj8WGHeYM41IT7w7Pjr35dt5m27ERSMa_ltLIqM5YrsZy6-VPcjShNWBiwaOjmZ9TA6C9vW7GmQjNqLGE4R148qi94EnRIKjzolzeP5WUdEB_7wHblRxbj-JG1gA7I4A-VAWQiRkMEx_W9RdYJyhqRo9wgiV9BUm3RYEWltinmIWyHs7ltvWgH5HeRqvdGsn_YOVh4XFMYIt0v1_KvxvJFAIXv3rYnVPNLIF4T6myn5tBxWwJAKkX9tMiK1O-PuTrPRTJB8Gt_yV644S_ALqW9l9gsUKVZ76_SkpIVTfVsPu_-YVrXdMsz2JRq8td0u50_Y9UPnFC1AkVeAxyCp5pIqhdudEjLVZr_r8aKG37R&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NULL);
