INSERT INTO places VALUES(1178,'西区の新町にある 自然とお肉green🌱 もーめちゃくちゃ大好きなお店🤍🤍 軽く飲みたくてぶらぶらしてて、フラッと入ったお店が良すぎて、ランチも夜も行ってる🙈 前までは夜おでんとおばんざいやったけど2月1日リニューアル🙌 肉料理メインのお店に✨ そして行ってめっちゃテンション上がったのがこの親子丼🙈 ランチで期間限定やったのが、人気で夜もやってほしいって声があったらしくメニュー化されてる😍 夜は土鍋ご飯で提供✨ ランチは丼ぶりで提供してくれるよー！ 他にも食べた黒毛和牛とごぼうの土鍋ごはんも美味しすぎた！！ ハラミサンドもやばい🤍 牛タンもおすすめ🤍 またフィードでもあげるからそれ見てっ✨ 店員さんもマジで面白いから🙈🙈 1人6,000円以上はいただきませんってシステム✨ めちゃくちゃいいお店やからぜひ🙌 ごちそうさまでした♪ 📍大阪市西区新町1-24-14 🕒ランチ11:30〜14:00  ディナー17:00〜23:00 ※ランチは平日のみ　金土は24:00まで #自然とお肉green  #肉バル #新町 #新町グルメ #四ツ橋グルメ #親子丼 #死ぬ前に食べたいのは親子丼 #土鍋ごはん  #堀江  #堀江ランチ  #堀江グルメ  #堀江ディナー  #新町ランチ  #グルメ #グルメ女子  #グルメスタグラム  #大阪グルメ #大阪ランチ #大阪ディナー #dinningbargreen',40700,1400000,'meguminmin1210','["自然とお肉green","肉バル","新町","新町グルメ","四ツ橋グルメ","親子丼","死ぬ前に食べたいのは親子丼","土鍋ごはん","堀江","堀江ランチ","堀江グルメ","堀江ディナー","新町ランチ","グルメ","グルメ女子","グルメスタグラム","大阪グルメ","大阪ランチ","大阪ディナー","dinningbargreen"]','https://m.tiktok.com/v/7338612454739447047','大阪市西区新町','自然とお肉green','大阪市西区新町にある肉料理メインのお店(2月1日リニューアル)。以前は夜はおでんとおばんざい中心だったが、現在は肉料理が中心となっている。親子丼(ランチは丼、ディナーは土鍋ご飯)、黒毛和牛とごぼうの土鍋ご飯、ハラミスンド、牛タンなどが人気メニュー。店員さんが面白く、1人6000円以上の会計はないシステム。ランチは平日のみ、金土は24時まで営業。',34.67624430000000046,135.4955251000000089,'2025-04-17T10:26:13.209+00:00','2025-04-18T03:08:22.011+00:00','Japan, 〒550-0013 Osaka, Nishi Ward, Shinmachi, 1-chōme−24−１４ 1F西側','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcKz4DKw1pYGO-Qpd9Lm5nP0N5_vKelET14j0XrD8xRI3jX9Px5Q2fClna5rzatG_zlEUNxkbRLfckldnD6bKuAErh4jHaLfy_WbcyGAw_xUpoKOKJ8cMGcv_H06pnfZXX8YAB_Jp7PVe7-d5QR4H3vefSUIyjXmC9GhNeZ0EwIrTstkQoOouT6v4a540hbDMXwkruSIZiMFjYs4n-sVg5yiLOR7EQMKUwZ7M6as1NiFtBG_XJUeug18sYMwv8D_1f8CgKaQolJHDBwI0Vt8DPGXgM2145wRCJHAITwfsYe_vhdQSa9IUa0_rz2_rgjC5TmoIA1vF74&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NULL);
INSERT INTO places VALUES(1179,'⠀ ＼ 鵠沼海岸のパンケーキ ꪔ̤̮ ／ ⁡ 𝗣𝗖𝗛 𝗰𝗼𝗳𝗳𝗲𝗲 ◇自家製とろけるプリン＆リコッタスフレパンケーキ 1,350円 ◇アイスコーヒー 400円 ◇リンゴジュース400円 ⁡ ぷわぷわのパンケーキが食べられるお店🥹🫶 ⁡ きめ細かいメレンゲとリコッタチーズを入れて 作られたパンケーキは、ふわふわエアリーで とっても美味しいです♡♡ 本当にふわっふわ☁️✨ メープルシロップやホイップバターとの相性も最高🤤💞 二人でシェアしたのであっという間に完食しちゃった😕 ⁡ プリンはメニュー名の通り、柔らかくてとろける食感🍮 💂‍♂️が飲むように食べていらっしゃいました🙃🥛 ⁡ テラス席はペット可🐶 店内はオレンジライトで暗いから、テラス席がおすすめ☺︎ ネット予約可能です🌼 この日は夕方伺いましたが、 良い風が吹いて心地よく過ごせました✨ 秋も少しずつ近づいてるのかな☺︎ ⁡ #パンケーキ #pancake #fullufypancakes#神奈川スイーツ #神奈川スイーツ #神奈川グルメ #カフェ巡り ',37500,884000,'panmon15','["パンケーキ","pancake","fullufypancakes","神奈川スイーツ","神奈川グルメ","カフェ巡り"]','https://m.tiktok.com/v/7275841510061395208','鵠沼海岸','PCH coffee','鵠沼海岸にあるカフェ。自家製とろけるプリンとリコッタスフレパンケーキが人気メニュー。ふわふわでエアリーな食感のパンケーキは、メープルシロップやホイップバターとの相性抜群。とろける食感を特徴とするプリンも提供。ペット同伴可能なテラス席と、オレンジ色の照明が特徴的な店内がある。ネット予約が可能。',35.32432690000000264,139.4667967999999974,'2025-04-17T10:26:13.213+00:00','2025-04-18T03:08:22.418+00:00','7-chōme-12-17 Kugenumakaigan, Fujisawa, Kanagawa 251-0037, Japan','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcKAW_POeEZ2S82D0z0sU19LLOBRxeR63rKzePY8a_pNyzwE5LtwpDwcX0YRUDQ8CMHpA8A7tpK7zApYHx9HLfoy_3689j6lSclfK5qAk5rPw_mv26u3vbMO6kBDhWkQvGo-KpQ1dKy42wZRexpC2pt_xDJu7HoyNylBYg12EK087PoNw4ApM9WAv181Ld-mQ_4Nnlg4p0Lyr9pJtiM5S7CPge1zdnS3E4c4cWVDC66qq9SqMK_cYOeXqVaU5MwghNNYcsmYwqVQmaU6KnAu0i5FO3EEGgadYS2A12tHVMUY-8w4-tgdGBxFeDarsJL2Y_LHaP3bmWM&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NULL);
