INSERT INTO places VALUES(1187,'詳細はコチラ↓ この度もご視聴ありがとうございます😉✨ まるで鬼滅の刃の世界を味わえる【魚籠屋】を知っていますか？✨ このスポット、実はずっと行ってみたかったんです😤 (やっと行けた〜‼︎) このお店の自慢はなんといっても新鮮な魚料理‼︎ 動画では紹介してませんが、踊り食いもできる程、鮮度が高いんです！🫢 定食もボリューミーだし「鮎塩焼き」や「焼きおにぎり」は目の前の囲炉裏で焼く姿を見ることができます🔥 焼きおにぎりは魚の粉末を使用した特製の醤油を使用してるので格別でした🥹👏 スタッフの方々も本当に優しくて 愛されるお店ってこういうお店なんだなと感じました☺️ オススメなので是非、行ってみてくださいね！😆 【魚籠屋】 📍群馬県高崎市榛名山町360 #群馬グルメ  #魚籠屋  #群馬観光',32900,1500000,'date_spot_','["群馬グルメ","魚籠屋","群馬観光"]','https://m.tiktok.com/v/7454203468258037010','群馬県高崎市榛名山町','魚籠屋','群馬県高崎市にある、鬼滅の刃の世界観を思わせる雰囲気のお店。新鮮な魚料理が自慢で、踊り食いもできるほど鮮度が高い。ボリュームのある定食や、囲炉裏で焼かれる鮎の塩焼き、焼きおにぎりなどを提供。魚粉末入りの特製醤油を使った焼きおにぎりは特に美味しいと紹介されている。スタッフの対応も良く、居心地の良いお店とされている。',36.44400830000000013,138.8433502000000032,'2025-04-17T10:26:13.231+00:00','2025-04-18T03:08:25.153+00:00','360 Harunasanmachi, Takasaki, Gunma 370-3341, Japan','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcKP9DFL4YKHcoCmq4u0A_39gBbJoOADP3NZ9Ly21CZOu_ZYunil_HRbbu5hOpc07iqidwmIyiXYutRwQzwc5IB_7xSBu5tfMzFF32HLfMaalSkTNHZeFqp35DjotbLzebtnxA7im2y9PQdA6uks_tr5fLNodgxE1eDEqFO-Rs0QvS-oZFBAZPILsIdfC7nU8opRyG3D61C5Davs_qk1kX-TFa7E0oFW6Oxky79gVbAzHTefmaf625PC0VSEMUTu--fpHdCIQNKx4FXudAr9yW-ApZC5MYLmvXd5EdcCcI9Gf20QgfH8oVjX9_J5NzkMZC8H9mk1iLs&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NULL);
