INSERT INTO places VALUES(1193,'SNSで大人気！モッチモチのあん巻きから抹茶味が新登場！ 国産の宇治抹茶を使った生地はふんわりしていて甘いみたらし団子との相性抜群。 みたらし団子の他に抹茶あんと草団子を巻いた抹茶団子あん巻きもあり抹茶好きにはぜひ食べて欲しい逸品！ 12:30と15:00頃にいくと焼きたてが食べられるため食べ歩きや手土産にもオススメ！ 《今回注文したお料理》 抹茶あんまき　 （みたらし・草団子）　各540円 《店名》和かろん専門店 和果 《住所》大阪府大阪市西区北堀江1-11-6  《最寄り駅》四ツ橋駅6番出口から徒歩2分 《営業時間》11時から18時 《定休日》なし 《予約》不可 《駐車場》なし A big hit on social media! A new matcha flavor has been added to the chewy bean-jamaki! The matcha-flavored dough is soft and goes perfectly with the sweet mitarashi dango. In addition to the mitarashi dango, there is also the matcha dango bean-jamaki, which is a roll of matcha bean-jam and kusa dango, a must-try for matcha lovers! If you go around 12:30 and 15:00, you can eat freshly baked bean-jamaki, so it''s recommended for eating on the go or as a gift! 《Food ordered this time》 Matcha bean-jamaki (Mitarashi/Kusa dango) 540 yen each 《Store name》Wakaron Specialty Store Waka 《Address》1-11-6 Kitahorie, Nishi-ku, Osaka City, Osaka Prefecture 《Nearest station》2 minutes walk from Exit 6 of Yotsubashi Station 《Business hours》11:00 to 18:00 《》Wednesdays 《Reservations》Not accepted 《Parking》No #大阪グルメ #堀江グルメ #japanesefood #tiktokfood ',29700,654900,'manpuku_gourmet_food','["大阪グルメ","堀江グルメ","japanesefood","tiktokfood"]','https://m.tiktok.com/v/7479741473676741906','大阪府大阪市西区北堀江','和かろん専門店 和果','大阪市西区北堀江にある和かろん専門店。SNSで人気のモッチモチのあん巻きに、抹茶味が新登場。国産宇治抹茶を使った生地と、みたらし団子の組み合わせが特徴。抹茶あんと草団子を巻いた抹茶団子あん巻きもある。12:30と15:00頃が焼きたてで、食べ歩きや手土産におすすめ。抹茶あん巻き(みたらし・草団子)各540円。営業時間は11時～18時、無休、予約不可、駐車場なし。',34.67339179999999743,135.4954200999999899,'2025-04-17T10:26:13.246+00:00','2025-04-18T03:08:27.159+00:00','1-chōme-11-6 Kitahorie, Nishi Ward, Osaka, 550-0014, Japan','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcI8rzbGbMbJ-9wApr3EstgLWadkbcW1CJNFwU0375uM7EU2CzeVJOyC4XTMnvXZXX9K_OSKbQGph0Ibk-b4fEPDzVnCwMmLwuiX2IoCLbjNZAxXroNKAFTDmzM-Vgwj4BHBRZPwG_aybegFCmSKcoE1VxG5_WCSM634fE5aZrI1RyjvniJcRUszpfFuH--PGA0amKoq8IxBJXxI0emEpvAKPt3LGUztEDBC8R5h4MGJY7Hv4