INSERT INTO places VALUES(1226,'3月31日まで、ランチがなんと‼️1000円OFF‼️😳𓂃 ◌𓈒𓐍  　 ⁡ 𓊆  Tea Lounge ISOLA 𓊇 ⁡ ⁡ ＼超お値打ちランチの概要は本文↓を読んでね💓／ ⁡ ⁡ 3月3日NEW OPEN✨ ⁡ ⁡ 見た目も美しく繊細で、かつ 美味し過ぎるおばんざいランチが ⁡ 自分で煎じて愉しむ焙じ茶や 急須で頂く煎茶と共に楽しめる🍵 ⁡ ⁡ とってもオシャレなお店が出来ました🥰 ⁡ ⁡ 間違いなく大人気店になると思うので、 今のうちに保存してね❤️❤️ ⁡ ⁡ * ┈ ┈ ┈ ┈ ┈ ┈ ┈ ┈ ┈ * ⁡ ⁡ 阪急烏丸駅から徒歩約1分、 四条通り沿いにあるビルの2階という抜群の立地で💓 ⁡ ⁡ 祇園祭の時期には 「月鉾」「鶏鉾」「函谷鉾」が見渡せる ⁡ オープンテラスまで備えた素敵過ぎるお店 『TEA LOUNGE ISOLA』さん✨ ⁡ ⁡ エレベーターの扉が開くと モダンでお洒落な雰囲気が広がる とっても落ち着く空間です☺️ ⁡ ⁡ 𓐍お昼の時間には、美味しいおばんざいと共に 自らお茶を煎り、香りを楽しみ、深く味う🌿 ⁡ ⁡ 𓐍カフェタイムにはスイーツやスムージーを堪能し🍓 ⁡ ⁡ 𓐍夜の時間には、🍸をスイーツやおつまみと共に ​味わいながらゆっくりと過ごせる🌙 ⁡ ⁡ それぞれの時間毎に違った 楽しみ方が出来る素敵なお店さんですよ🥰 ⁡ ⁡ 今回は、見た目も鮮やかな美味しい ランチメニューを頂いてきました♪ ⁡ ⁡ 𓏸𑁍𓏸𓈒𓂃𓂃𓂃menu𓂃𓂃𓂃𓏸𓈒𑁍  ⁡ ⁡ ランチの種類は 【16種類の彩り膳　2.800円（税込）】の一種類☺️ ⁡ ⁡ 𓐍お茶セット、3,000円 　※ボトリングティーは＋800円 ⁡ 𓐍コーヒーセット、3,200円 ⁡ ⁡ と、＋200円〜で美味しいドリンクが付けられます💓 ⁡ ⁡ ／ なんと今なら、オープン記念価格で ⁡ 𓐍ランチ御膳1,000円OFF‼️ 𓐍ドリンク全品半額‼️ ＼ ⁡ と、赤字覚悟の超お値打ちで頂けるんです😳😳😳 ⁡ ⁡ 御膳には、鮭や2種類の焼きおにぎり、 味噌汁、デザート、16種類のおばんざいが セットになっています♪ ⁡ ⁡ 【おばんざいのお品書き】 ⁡ <上段の小鉢＞ ・万願寺の甘辛かつお煮 ・のんばらこんにゃくの田舎煮 ・青菜の煮びたし ・筍の煮物 ・ほうれん草の白胡麻和え ・茄子の揚げびたし ・蓮根の梅肉和え ・栗とホイップ ⁡ ＜下段の小鉢＞ ・タンドリーチキン ・きんぴらごぼう ・唐揚げ ・生ハムとフルーツ ・スモークサーモンのマリネ ・フルーツトマトのハチミツマリネ ・季節のお漬物2種 ⁡ ⁡ 産地にも拘られた食材を使用した 彩り豊かなおばんざいは どれも本当に美味しくて🥹 ⁡ ⁡ ちょうどいい塩加減の鮭と、自分で焼く 焼きおにぎりの相性も抜群でした😋 ⁡ ⁡ お味噌にも大きなお豆腐が入っていたりと、 お料理の全てに拘りを感じられましたよ💓 ⁡ ⁡ 特にお茶の種類は、京都のものだけでなく 日本各地からお店に合うものを厳選されていて♪ ⁡ ⁡ 茶葉を自分で煎る事が出来て、 煎りたてのお茶の香りと 味わいを楽しめるのが ⁡ とっても素敵な体験でした🥰🍵 ⁡ ⁡ 𓏸𑁍𓏸𓈒𓂃𓂃𓂃𓂃𓂃𓂃𓂃𓂃𓏸𓈒𑁍  ⁡ ⁡ ランチのお時間は 【11:30～、13:30～の2部制】🌸 ⁡ ⁡ 今はまだオープンしたてで穴場でしたが、 そのうち予約でいっぱいになると思います…🥹✨ ⁡ ⁡ 是非一緒に行きたい方に 飛行機マークでシェア✈︎して✈️ ⁡ 早めに行ってみてね🥰🫶🏻❤️ ⁡ ⁡ * ┈ ┈ ┈ ┈ ┈ ┈ ┈ ┈ ┈ * 　 ⁡ Tea Lounge ISOLA ⁡ 📍 京都府京都市下京区函谷鉾町77 MOKU KYOTOビル 2F ✽ Tel  075-201-0100 ✽ 営業時間　11:30 - 22:30 ✽ アクセス　阪急烏丸駅、地下鉄四条駅徒歩すぐ ✽ 予約可能 ✽ 子連れ可能 ⁡ ⁡ ✼••┈┈┈┈┈┈••✼••┈┈┈┈┈┈••✼   ⁡ ⋆⸜ 最後までご覧頂きありがとうございます✿ ⸝⋆ 　 ⁡ 　京都生まれ京都育ち30代ママが 　実際に行った旬のスポットを発信中 ✎𓂃 ⁡ 　行きたいと思ったら『保存』と 　『フォロー』で最新情報をチェックしてね💓 ⁡ ⁡ ✼••┈┈┈┈┈┈••✼••┈┈┈┈┈┈••✼ ⁡ PR #京都ランチ #烏丸ランチ #京都グルメ #烏丸グルメ #京都カフェ ',7115,309000,'sorami_kyoto','["京都ランチ","烏丸ランチ","京都グルメ","烏丸グルメ","京都カフェ"]','https://m.tiktok.com/v/74797841556