INSERT INTO places VALUES(1227,'保存推奨‼️凄すぎるお店発見❤️‼️ここレベルにコスパいいお店は正直見たことないかも🫢🫢🫢 ーーーーーーーーーーーーーーーーーーーーーーーーー 気に入った、行ってみたい、食べてみたい と思った方は いいね👍コメント📝保存🥰フォロー☝️ お願いします🙋🏻‍♀️ 愛知県、特に名古屋市、愛知西部中心に グルメ、観光スポットを発信してます🙋🏻‍♀️ 時々レシピ付き料理も🫶よろしくね🙌 リール動画が好評❤️是非見てね😉 過去の投稿はコチラ👇 @hiro_meshi_gourmet  ーーーーーーーーーーーーーーーーーーーーーーーーー コスパ凄すぎるお店発見🤩🤩🤩 ここは凄いよ‼️ たまたまランチ難民で遅めのランチ探してたら 出会ったお店☺️☺️☺️ 昔ながらの居酒屋な雰囲気なんだけど ランチが驚愕すぎた🙌 それ以上に看板娘さんの人柄が良すぎてほっこり☺️☺️☺️ 心もお腹も満たされる素敵なお店だよ🥰🥰🥰 こんなに美味しくて何より安くて 手間のかかった素敵なランチ初めて食べたかも🫢🫢🫢 そんなレベルでヤヴァイ😍😍😍 接客も気持ちよくて居心地も良すぎる☺️ しかも駅前の好立地なのに駐車場まである🚙🅿️👍 最強すぎるお店🙌 そしてランチメニューとおばんざいは は毎日変わるみたいだから 毎日通っても飽きないよ🥰🥰🥰 この日頼んだのが 🔸とり天おろしランチ８００円（全て税込価格） この日のメニューは ・みそかつ８８０円 ・とり天おろし８００円 ・若鶏唐揚げ７８０円 ・赤魚粕漬８００円 ・太っちょイワシ８００円 ・ホッケ８５０円 だったよ😉 その中で私はとり天おろしを頼んだよ🙋🏻‍♀️ メインのとり天はサクサクで お肉もめちゃくちゃ柔らかくてもはや歯無くても 噛めちゃうレベルの柔らかさだった🤩🤩🤩 そしてメインが美味しいのも去ることながら おばんざいの量と種類が凄すぎなの😍🥰🙌 ・だし巻き卵（売り物を超える美味しさ優しくて最高🙌） ・ほうれん草と豆腐の炒め物（優しいお味‼️ちゃんと丁寧に使った味がしたよ😉） ・ひじき（野菜たっぷり‼️味付けもお袋の味🥰） ・パスタサラダ（こらも野菜たっぷりレタスとトマト入っててマヨネーズにカラシも入れてあってめちゃくちゃ美味しい🥰） ・ロールキャベツ（これだけでもはや定食で出せるレベルの美味しさ🥰😍） ・昆布（手作りでコンビニおにぎりの昆布より遥かに美味しかった❤️） ・味噌汁 ・ご飯（大盛りは＋５０円） どーしてこんだけ安く出せるのか聞いたら おばんざいを作られてるここの看板娘さん（動画参照） のお母さんがタダで野菜をご近所さんから もらったりするからだそうです🥹🥹🥹 そして看板娘さんのお母さんの手作りおばんざい🥰 て事は本当に地産地消なランチって事だよね🥹🥹 素敵すぎる❤️❤️❤️❤️❤️ どのおばんざいもめちゃくちゃ美味しくて これだけついていて８００円ポッキリは 神でしかない👼👼👼 ランチメニューもおばんざいも毎日違うみたいです☝️ 楽しみすぎるよね😍😍😍 なかなか出会えないレベルのお店でした👍 また行きたいです😆 是非行ってみてね💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️ 🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱 なかちゃん 📍愛知県北名古屋市徳重広畑60-1  名鉄徳重名古屋芸大駅徒歩５秒 ☎️0568-25-2803 🈺 [月・水～金] 11:30～14:00 17:00～23:00　 [土] 17:00～23:00　 [日] 11:30～22:00　 日曜営業 定休日:火曜日、 毎月25日前の月曜日 🅿️あり‼️（駅前のお店なのに駐車場あるの珍しい！分かりにくいので詳細はフィードで投稿します👍参考にしてね😉） 支払い:現金 🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱 #コスパ #コスパ最高 #コスパ最強 #コスパランチ #お好み焼きなかちゃん  #なかちゃん #居酒屋ランチ #愛知グルメ #愛知ランチ #愛知居酒屋  #名古屋グルメ #名古屋ランチ #名古屋コスパランチ #名古屋居酒屋 #名古屋ディナー  #北名古屋市グルメ #北名古屋グルメ #北名古屋市ランチ #北名古屋ランチ #徳重ランチ  #北名古屋お好み焼き #北名古屋市お好み焼き #北名古屋鉄板焼き #徳重名古屋芸大駅 #徳重名古屋芸大駅前  #看板娘 #看板娘がいるお店',6894,2200000,'hiro_meshi_gourmet','[