INSERT INTO places VALUES(1235,'8月末までに行かないと 二度と食べたくなるかも… 今行かないと後悔する話題の桃が丸ごと乗ったプリン。 大きな桃を割ると、大量の甘さ控えめの生クリームが詰まっています。 みずみずしい桃と硬めのプリンを一緒に食べると至福の味に。 8月末までの営業になるみたいなので、 気になる人は保存して行ってみてね。 The last one at the end of August.  You may never want to eat it again...  The much talked about pudding with a whole peach on top that you will regret if you don''t go now.  When you break open the large peach, it is filled with a large amount of sweetened whipped cream.  The fresh peaches and hard pudding together make for a blissful experience.  It looks like it will be open until the end of August,  If you''re interested, save it and go there. ⚠️去年は完全予約制でしたが、今は予約制ではなく 来店順に提供されるみたいのなので、早めの時間帯の来店をお勧めします！ 今年の8月に営業が終わりらしいので気になる方はお早めに🍑 ーーー店舗情報/store informationーーー 【hitoma コーヒーとお酒】 📍: 東京都台東区松が谷1-13-10 安達ビル 1F 🚃 : 稲荷町駅徒歩7分/上野駅徒歩15分 ⏰ : 13:00-16:00/19:00-25:00 📅 : 不定休 💰 :☀️¥1,000-¥1,999　🌃¥1,000-¥1,999  🛜 : ー 🔌 : ー 🤱 : ◯ ※お店狭め 🐕 : ー 〜食べたもの〜 桃とプリン¥2300〜 アイスコーヒー(アメリカーノ)¥500 #上野カフェ#上野グルメ #稲荷町カフェ #プリン',3974,151300,'masa_tarrace','["上野カフェ","上野グルメ","稲荷町カフェ","プリン"]','https://m.tiktok.com/v/7385449263464975633','東京都台東区松が谷','hitoma コーヒーとお酒','東京都台東区松が谷にあるカフェ。桃が丸ごと乗ったプリンが人気メニューで、桃の中には甘さ控えめの生クリームがたっぷり入っている。みずみずしい桃と硬めのプリンの組み合わせが美味しいとされている。価格は2300円前後。アイスコーヒー(アメリカーノ)は500円。8月末までの期間限定営業で、来店順に提供されるため、早めの来店がおすすめ。稲荷町駅から徒歩7分、上野駅から徒歩15分。営業時間は13:00～16:00、19:00～25:00、不定休。店内は狭め、ペット同伴不可。',35.71108439999999717,139.7814711000000045,'2025-04-17T10:26:13.360+00:00','2025-04-18T03:08:40.132+00:00','Japan, 〒110-0015 Tokyo, Taito City, Higashiueno, 3-chōme−34, 3-34-4 ロタ東上野ビル101','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcJexyM4xCGPDK3225K0dOnapPqXfW8Daxa8SgYb4sqzfCv1PCB59M0ua2uT4kMbmBy8KgHF_knpR_VmzMEaaFfduxO4neP52xHW5D97ux22p3sG2QqxL2a0Nioy87VNJv-fcHt-vfZrL5v6Vc3iqKmiITwoakpHxtBzCh1KdhG6gxm1QtNHyjCil3xdhcOk8BxgwUvbc8xR0u25Utx0UU4y20_lYBKeYuURJE3FhnJHeqpIdYm9MsusTGM5EN-e-ug0UpbNrK1wqOZBdPX7DuSx7rRMOi3wTaFh9NZ_rZ9B2gd5j5Zz8RlfcR0FxvqAG1Re0hMoeNc&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVn