INSERT INTO places VALUES(1239,'超絶オススメランチ発見‼️ここは凄いよ‼️😆 ーーーーーーーーーーーーーーーーーーーーーーーーー 気に入った、行ってみたい、食べてみたい と思った方は いいね👍コメント📝保存🥰フォロー☝️ お願いします🙋🏻‍♀️ 愛知県、特に名古屋市、東尾張中心に グルメ、観光スポットを発信してます🙋🏻‍♀️ 時々レシピ付き料理も🫶よろしくね🙌 リール動画が好評❤️是非見てね😉 過去の投稿はコチラ👇 @hiro_meshi_gourmet  ーーーーーーーーーーーーーーーーーーーーーーーーー 前々から行きたくてなかなか行けなかったお店‼️ やっと行けたけど… ここはヤバい😆‼️ 凄過ぎる🤩🤩🤩 最近食べた日本食系のランチで一番感動したかも🥰 お店も今年の５月オープンしたばかりで 超‼️超‼️超穴場‼️ 今のうちに行ける人は行って 感動してきて🤩🤩🤩 お店もオープンしたてなのでめちゃくちゃ綺麗で 和な雰囲気で寛げるよ👍 この日頼んだのが 🔸燈し火ランチ１５８０円 ・おばんざい盛り合わせ これが凄すぎ‼️ 見た目も綺麗でどれ食べても絶品すぎた😋❤️ 手間のかかるおばんざいが勢揃い😆 最高過ぎるよ😆 ・お刺身 ２種乗ってたけどどっちも新鮮🤩🤩🤩 美味しかった😋 ・茶碗蒸し 具沢山で牡蠣？ムール貝？も入ってて 出汁効いてて美味しい🤤 ・サラダ ちゃんと量あった👍 ・天むす２個 海老がプッリンプリンでたまらん🦐 ・味噌汁 ちゃんと味噌多めで出汁も強め❤️ ・漬物 美味しい漬物🫶 ・デザート このデザートも手作りで手間をかけて 作ったやつ👍 もう最高過ぎるお店‼️ 夜は居酒屋さんで おばんざいと焼き鳥がオススメみたい😆 そっちも🫣〜‼️また夜もお邪魔予定😁🤘 是非行ってみてね💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️💁🏻‍♀️ 🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱 和食・焼き鳥・燈し火 📍〒488-0818 愛知県尾張旭市向町３丁目２−１ メゾンソフィア ☎️0561-56-4750 🈺11:00〜14:00   17:00〜23:00 定休日:水曜日・第一第三火曜日 🅿️あり 支払い:現金・カード・電子マネー・ＱＲ 🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱🍱 #和食ランチ #和食 #和食ディナー #japanesefood #japanesefoods  #washoku #おばんざい #居酒屋ランチ #創作ランチ #和食焼き鳥燈し火  #燈し火 #尾張旭グルメ #尾張旭ランチ #尾張旭ディナー #尾張旭居酒屋  #瀬戸市グルメ #瀬戸市ランチ #瀬戸市ディナー #瀬戸市居酒屋 #瀬戸市和食  #尾張旭和食 #名古屋グルメ #名古屋ランチ #名古屋居酒屋 #名古屋ディナー  #守山区グルメ #守山区ランチ #守山区ディナー #守山区居酒屋 #守山区和食 ',2571,1100000,'hiro_meshi_gourmet','["和食ランチ","和食","和食ディナー","japanesefood","japanesefoods","washoku","おばんざい","居酒屋ランチ","創作ランチ","和食焼き鳥燈し火","燈し火","尾張旭グルメ","尾張旭ランチ","尾張旭ディナー","尾張旭居酒屋","瀬戸市グルメ","瀬戸市ランチ","瀬戸市ディナー","瀬戸市居酒屋","瀬戸市和食","尾張旭和食","名古屋グルメ","名古屋ランチ","名古屋居酒屋","名古屋ディナー","守山区グルメ","守山区ランチ","守山区ディナー","守山区居酒屋","守山区和食"]','https://m.tiktok.com/v/7286815882456632583','愛知県尾張旭市向町','和食・焼き鳥・燈し火','愛知県尾張旭市にある、5月にオープンしたばかりのお店。ランチは1580円の燈し火ランチが紹介されており、見た目も美しい盛り付けのおばんざい、新鮮なお刺身、茶碗蒸し、サラダ、天むす、味噌汁、漬物、デザートなどがセットで提供される。おばんざいは、近所の方から野菜を無償で提供してもらっているため、この価格で提供できているとのこと。夜には居酒屋として営業し、おばんざいと焼き鳥がおすすめ。営業時間は11:00～14:00、17:00～23:00。水曜と第一・第三火曜が定休日。駐車場あり。現金、カード、電子マネー、QRコ