INSERT INTO places VALUES(1240,'映画のなかにタイムスリップ！？ 明治時代の街並みが残ってます。 0,2歳児を連れなので、混雜していないところがいいなぁ…と思い立って来てみたら大正解！ 混み具合は、三連休でもこんな感じで、平日はさらにゆったりしてるので、小さい子ペースで歩いても問題ないのが助かる◎ 駅を出てすぐ参道なのも、めちゃくちゃありがたい✨ 目的地までの移動が一番大変だったりするの私だけでしょうか😇 📍#柴又帝釈天参道  住所：東京都葛飾区柴又 アクセス：京成金町線柴又駅からすぐ 📍#柴又帝釈天 （題経寺） 📝おすすめグルメ @ojigi_chaya  参道に入る直前にあります。子どもたちにカラフルな風船を配ってた！動画に出てくるレインボークリームソーダのほか、主な腹ごしらえはここでしました♪食べ歩き、店内、軒下どれでも対応可能。映えスイーツからおつまみから定食までありました😋 #高木屋老舗  参道入ってすぐ。参道をはさんでおみやげ屋さんと喫茶の二店舗あります。名物「草だんご」も😊かき氷とお団子(撮り忘れた)を頂きました😋 周辺スポットもまたレポします✌️ ◉◎◉◎◉◉◎◉◎◉◉◎◉◎◉ 0,2歳の年子育児に奮闘するママ。 旅行会社さん、自治体さん、観光局さんをサポートして「やってみたい」を叶える面白ツアーを200以上プロデュース。3000名以上と旅しました😊 みんなで理想の子連れ旅を作るコミュニティ作ります🚗 投稿は、実際に行った場所や体験から。リアルな情報です😊◉◎◉◎◉◉◎◉◎◉◉◎◉◎◉ #柴又 #草団子 #東京かき氷 #下町グルメ #下町散歩 #穴場スポット',1993,291800,'tabimama.manamin','["柴又帝釈天参道","柴又帝釈天","高木屋老舗","柴又","草団子","東京かき氷","下町グルメ","下町散歩"]','https://m.tiktok.com/v/7122274041213373698','null','null','null',NULL,NULL,'2025-04-17T10:26:13.375+00:00','2025-04-17T14:25:19.053+00:00',NULL,NULL,NULL);
