INSERT INTO places VALUES(1277,'🕊@mktravel_saitama ◁埼玉をもっと楽しむ⚽️埼玉発子連れおでかけ✈️ 今回紹介するのは『ロッテワールド（ソウル🇰🇷）』です♪ 子連れで初めての韓国旅行！ 今回の旅で1番楽しかったスポットです💕 なんと超巨大な室内遊園地！ 屋内と屋外が同じくらいの広さです！ 極寒の韓国の冬でも楽しく遊べることができ、 子供向けアトラクションがとにかく多い！🥰 （子供が小学生になったら屋外のアトラクションを楽しみたいです🥹ジェットコースターめちゃくちゃ楽しそう！） 今回はチケットを@klookjp にて購入しました🎫 割引価格で1人3700円で、さらにそこからPayPay支払いで20%オフ！ 約3000円で乗り放題チケットを購入することができました(^^) クルックの20%オフはイベントごとに定期的にクーポンが配布されていて、激戦とかではなく決まった日であれば誰でも割引価格で購入できます！ ※激戦ですが、50%オフのチケットも出ています🤗 私は今回は子供も大人と同じチケットをクルックにて購入しました。 クルックでは子供料金を見つけることができず、公式で買う子供料金よりも安かったので大人料金にしました(^^) 当日は電子クーポンをパークのスタッフに見せると 引き換え場所を案内され、スムーズに入園できました☃️ 📍ロッテワールド ソウル特別市 松坡区 蚕室洞 40-1, ソウルロッテワールド (서울특별시 송파구 잠실동 40-1, 서울롯데월드)  日～木曜10：00～21：00(最終受付19：00)、 金～土曜10：00～22：00(最終受付20：00) 今回の投稿を読んでくれた方『いいね』 参考になった方『保存』よろしくお願いします🥺 投稿への励みになります😌💕 埼玉ママはぜひフォローを😆 ママ友感覚で仲良くしてもらえたら嬉しいです♪ 🤍🤍🤍🤍🤍🤍🤍🤍🤍🤍 さいたまで一番子育てを楽しむワーママ🌸 みい(先生ママ)  くう(建築士ママ) おでかけ✈️グルメ🍻大好きな2人が発信中！ @mktravel_saitama ストーリーズ限定で埼玉イベント情報や フォロワーさん同士で解決する 『子育てお悩み相談会』も開催中🕊 🤍🤍🤍🤍🤍🤍🤍🤍🤍🤍 #子連れ韓国  #韓国料金 #ロッテワールド  #子連れ旅行 #子連れ海外旅行準備  #韓国レポ  #埼玉ママ #子連れお出かけ  #韓国情報  #渡韓レポ  #韓国グルメ',54800,3800000,'mktravel_saitama','["子連れ韓国","韓国料金","ロッテワールド","子連れ旅行","子連れ海外旅行準備","韓国レポ","埼玉ママ","子連れお出かけ","韓国情報","渡韓レポ","韓国グルメ"]','https://m.tiktok.com/v/7305777196923243778','ソウル特別市松坡区蚕室洞','ロッテワールド','ソウル特別市松坡区にある屋内と屋外の両方を含む巨大な室内遊園地。子供向けのアトラクションが豊富で、韓国の冬の寒さの中でも楽しめる。Klookで割引チケットを購入可能(イベントにより割引率は異なる)。営業時間は、日～木曜10:00～21:00(最終受付19:00)、金～土曜10:00～22:00(最終受付20:00)。',37.5111157999999989,127.0981670000000036,'2025-04-17T10:31:30.757+00:00','2025-04-18T03:08:48.829+00:00','240 Olympic-ro, Songpa District, Seoul, South Korea','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcJs1INKdOMlJ_Njdo6dN2Th7RyJ9DYs5QxLO3egjv-ntNVqo8fvWtPF2qbnIv8Y_NRrMqVZpUWk5nnzmusRWFyElpR1EbV91HS_T7D8oFxV464hQC7884E4qxn3Xkd9Mj4I3Chb033nSDTai-8lrjsIts4VHvsdYS_l8C-imgIeODuk3U4NE4mjrquzStqrm9oVfwF54bdUCYRJ2sMWI8m29LO6itbyw_82NcIO3XxD0fXxZAjrZ5mSzOhjV-sISYsxdWOxqjmLl61lqBbrRkqKiq6NwCh9H9D9PrL463nabhfAB__k0DDBsUNiEWIq8OfPpGYN_zJaSEhGZBhxQ9Hi