INSERT INTO places VALUES(1304,'紙コップでトコトコ走るおもちゃを作りました。 動物にしたり、色んな顔で作ったり、２つ一緒に動かしてお相撲ごっこをしても楽しめます。 今回は車輪の部分にペットボトルのふたと重りにビー玉を使いましたが、使用済みの乾電池を使う方法もあります。 ※乾電池を使う際は、液漏れや漏電に注意して遊びましょう。プラスマイナス部分にセロハンテープなどを貼って絶縁しておくと良いです。 ============ ■材料 ・紙コップ ・ペットボトルのふた2つ ・（重りにする）ビー玉や粘土 ・輪ゴム ・テープ ・ホッチキス ・ハサミ ・必要に応じて、パーツ用に色画用紙やシールなど ■作り方 1.ペットボトルのふたにビー玉を入れテープでとめ、輪ゴムをテープで貼る 2.紙コップのフチに、対角線上に２ヶ所切り込みを入れ、輪ゴムをかける 3.切り込みを外側に折り返し、テープやホッチキスでとめる 4.紙コップにパーツをつけたり、イラストを描けば完成 5.車輪の部分をくるくる回してねじり、テーブルや床に置いて離せばトコトコ動き出します ■遊び方のコツ 車輪部分が床につかないと動かないので、紙コップの切り込みは深くなり過ぎないように注意してください。 うまく動かない時は、ねじる回数を多くしたり、重りを重くしてみてください。 ============ #tomonite  #トモニテ  #紙コップ工作  #工作  #製作遊び  #おうち遊び',16300,955000,'tomonite_official','["tomonite","トモニテ","紙コップ工作","工作","製作遊び","おうち遊び"]','https://m.tiktok.com/v/7333106272176327944','不明 (おそらく投稿者の自宅など)','不明','紙コップとペットボトルのふた、ビー玉などを使って、トコトコ走るおもちゃを作る方法を紹介する動画です。材料や作り方、遊び方が詳細に説明されています。場所は特定できませんが、自宅などの室内で行われていると推測されます。料理や食事とは関係ありません。動画の雰囲気は、工作や手作りおもちゃを紹介する教育的な内容です。',NULL,NULL,'2025-04-17T10:31:30.823+00:00','2025-04-17T23:12:07.710+00:00',NULL,NULL,NULL);
