INSERT INTO places VALUES(1311,'1日じゃ足りない！テーマパーク級の大型公園！ 福岡発の子連れの外遊びスポットを紹介しています💡 @weekend_outdoor_family 久しぶりに行った北九州市の #響灘緑地グリーンパーク 朝から夕方までいてどれだけ楽しめるか！？ いろんなアクティビティにも課金してみたよ😆 ＜ちょっとお得に遊ぶ方法2つ！＞ ※カンガルー広場（大人300円）と熱帯生態園（大人350円）の両方に入る場合は共通回数券（４枚つづり1,000円）を 買うと大人2人でそれぞれ購入して入るより300円安くなるよ！ ※空中冒険遊具あみ〜ごはアソビューで1日前までに購入すると100円引き（20％オフ）になるよ！当日購入はできないのと予約の時間が決まっているので要注意！ ——————————————— まずは一番最近できた大きな滑り台となが〜い滑り台とソリで遊ぶ👍✨ （ここは混むと聞いたので、朝イチに！ 夕方また行ったらめっちゃ多かった〜！） 空中冒険遊具あみ〜ごは3歳の息子も初挑戦！ ちょっと怖がってたけど、家族みんなでめっちゃ楽しんだ〜〜😍❤️‍🔥 カンガルー広場のふれあいタイムの時間チェックしていたから ふれあいもできたよ〜 おとなしくてふわふわでずっと触っていたかった😌 シマオイワワラビーは赤ちゃんがお母さんのお腹から 顔出しててめちゃくちゃ可愛かった〜〜〜🥹💓癒された💓 リアルな動く恐竜がたくさんいるディノパークは息子ビビりまくり🦖 行く前は恐竜見れること楽しみにしてたのに〜〜〜😂 温室のとなりのアグリズムカフェで飛んでる蝶を眺めながらランチを食べて、 熱帯生態園へ。 大きなナマズみたいな魚やカワウソ、日本最大の蝶オオゴマダラなどいろんな動植物を直近で観察できるよ〜不定期で餌やりなどのイベントも開催されてる！ ポニーに乗ったり（2歳から乗れるよ）、馬への餌やりもできるよ〜🐎 それからちびっこは大興奮の巨大砂場！水場もあるから楽しい要素が盛りだくさん！！ 落書きし放題の化石の谷でも遊びまくって 閉園ギリギリまでとことん遊び尽くしたよ〜〜〜！ 他にもおもしろ自転車やグランドゴルフ、サイクルボートもあるんだけど 流石に時間が足りなかった・・・🤣 キャンプ場もあるから次はキャンプとセットで行きたいな🏕️ ぜひチェックしてみてね💓 – * – * – * – * – * – * – * – * – * – * – * – * – * – * – * 響灘緑地グリーンパーク 📍住所：福岡県北九州市若松区竹並1006 🗓休園日： 火曜日 ⏰開園時間：9:00～17:00　 👛入園料：大人150円、小中学生70円、高齢者40円 　　　　　  未就学児無料 🚗駐車場：普通車300円、 　　　　　  中・大型車1000円（北ゲート前） – * – * – * – * – * – * – * – * – * – * – * – * – * – * – * ▸◂▸◂▸◂▸◂▸◂▸◂▸◂▸◂▸◂▸◂▸◂▸◂▸◂▸◂▸◂▸◂▸◂▸◂▸◂▸◂▸◂▸◂▸◂ ＼休日のどこ行く〜？を解決✨／するよ！ @weekend_outdoor_family 何もないと思っていたあのまちに、 こんな絶景が？こんな美味しいものが？ こんな楽しいスポットが？ そんな発見をたくさんしたい！ 子どもと全力で楽しむ ・福岡を中心の外遊びスポット ・旅行 ・キャンプ ・絶景スポット ・美味しいもの巡り^_^ を発信しています！ あれもこれも楽しみたい！欲張りママです！ 福岡発の子連れ旅＆おでかけは任せて〜！ —————— 💌PRのご依頼はDMにお願いします。 子連れスポット、ホテル、イベント等のPRの ご相談お待ちしています！ #福岡おでかけ　　#福岡ドライブ　#福岡子連れお出かけ　　#北九州市　#福岡公園　#響灘緑地',9096,525200,'weekend_outdoor_family','["響灘緑地グリーンパーク","福岡おでかけ","福岡ドライブ","福岡子連れお出かけ","北九州市","福岡公園","響灘緑地"]','https://m.tiktok.com/v/7435633960564100370','響灘緑地グリーンパーク','響灘緑地グリーンパーク','福岡県北九州市若松区にある響灘緑地グリーンパークを紹介する動画です。大型遊具、空中冒険遊具、カンガルー広場、熱帯生態園、ディノパーク、砂場、ポニー乗馬など、様々なアクティビティが楽しめる大型公園であることが説明されています。アグリズムカフェでランチも可能です。広大な敷地で一日中楽しめるテーマパークのような公園で、子連れ家族に最適なスポットであることが強調されています。'