INSERT INTO places VALUES(1315,'１時間で超楽しめる最強遊びスポット🔥💨 福岡･九州に絶対に行きたくなる!!🍜🏮旅行の参考になる最新情報!!是非フォローしててね!!☺️🔥 👉『 @ochika.no.insta 』  📍福岡県『楽しすぎた福岡の室内テーマパークw』 あの有名なバラエティ番組でもきてた、大バズりした超楽しいスポットに行ってきた‼︎ ここの施設では超楽しめるトランポリンが大きく5エリアあるよ！ ちっちゃいトランポリンがたくさんあるエリアや、めちゃくちゃ飛ぶことができるエリア！アクロバティック出来る人は挑戦してみて！😂 何より絶対して欲しいのがポールが回るトランポリンエリア！！ 真ん中にあるポールが速くなったり遅くなったり逆回転したり、予想不能すぎて本当に無理で面白い爆笑爆笑 あとは浮き輪に乗って飛んだり、ダイブしたりと１時間で信じられないくらい疲れる最強に楽しいスポットみんなも行ってみてね〜！！！ ☑︎トランポリンパーク　とびくる ☑︎福岡県北九州市八幡西区南八千代町3-12 ☑︎9:00〜20:00（火・水・木は18:45まで） ☑︎定休日　月曜日 《#おーちかmap検索🔎👀》 ハッシュタグ# を押して調べてね!!🔥 【エリア】 #おーちかmap_福岡 #おーちかmap_北九州 【時間帯】 #おーちかmap_昼 【条件】 #おーちかmap_スポット #おーちかmap_遊び ーーーーーーーーーーーーーーーーー✩˚｡⋆ 全国に😳福岡･九州の良さを届けたい!!🍜🔥 安く楽しく旅をする女子2人が教える!! 九州で一番分かりやすい旅アカウントです☺️ 福岡･九州好きな人が沢山集まりますように!!🫧【目標 フォロワー100万人!!(ᵕ̈)وو🔥】 楽しい事が大好きな『おーちかmap』2人が旅行プラン・１日ドライブ・グルメ・スポット・旅館など発信していきます!!☺️🌱 休日の参考にしてね!!✈️ 👉『 @ochika.no.insta 』 I am introducing Japan. thank you☺️❣️ #福岡#福岡旅行#福岡観光#福岡スポット#福岡ドライブ#北九州#北九州ドライブ#北九州スポット#北九州旅行#トランポリンパークとびくる#とびくる',8391,749300,'ochika_map','["おーちかmap検索🔎👀","おーちかmap_福岡","おーちかmap_北九州","おーちかmap_昼","おーちかmap_スポット","おーちかmap_遊び","福岡","福岡旅行","福岡観光","福岡スポット","福岡ドライブ","北九州","北九州ドライブ","北九州スポット","北九州旅行","トランポリンパークとびくる","とびくる"]','https://m.tiktok.com/v/7382513901809831175','福岡県北九州市八幡西区南八千代町3-12','トランポリンパーク とびくる','福岡県北九州市にあるトランポリンパーク「とびくる」を紹介する動画です。5つのエリアに分かれた大型トランポリン施設で、様々な種類のトランポリンがあり、大人も子供も楽しめる施設であることが強調されています。ポールが回転するトランポリンや、浮き輪を使ったアクティビティなど、ユニークなアトラクションが紹介されており、１時間では遊びきれないほどの充実した内容であることがわかります。動画の雰囲気は、アトラクションの楽しさを伝える、明るく活気のあるものです。',33.86235520000000321,130.7723424000000137,'2025-04-17T10:31:30.860+00:00','2025-04-18T03:08:58.765+00:00','3-12 Minamiyachiyomachi, Yahatanishi Ward, Kitakyushu, Fukuoka 806-0024, Japan','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcLDWQeMz_y5ZH1YVi_C4fy8u9b28kZePeGjf9KdGjzWib_bQD655a_jxUxpR6FTAfuTVpDHE-XXES47RmYbj8HMfF10GoisPOyzRS28JAbLOcxWXXPOqhdZJGhFRm0LwSC4qL_CkR4vR0vA42RUedUvPFl4xaHX1dGKbYSw62x-FeABswNJeLQiP584GkNUb0zYqI7N7EH17fdK1V_1PO-2NPC4n4V1VgTp1A-DwfwXrTvnAPzXRE7nf9ONp