INSERT INTO places VALUES(1326,'有料級レベルの大型公園💃 他のお出かけ情報はこちら→@neneko_3boys  ＼あいかわ公園／ 楽しそうとずっと気になってたここ、ようやく行ってきたんだけど、とても広くて遊びが充実してて1日楽しめます✨ 冒険の森でのアスレチックは少し大きい子供向けかと思いますが、見たこともないターザンライドや巨大迷路は、うちの5歳児は楽しくて何回もリピートしてました。2歳児はロング滑り台が楽しくてエンドレスです😂 少し離れたこども広場では、小さい子が楽しめる遊具が多くて、小さい子ならそっちをメインに楽しむのも良いと思う。芝生も広くてこれからの季節のピクニックは最高💃 乗物大好き我が家の3兄弟は、ロードトレインもめちゃくちゃ楽しかったし、初めてのダム見学も大興奮でした。夏はじゃぶじゃぶ池で水遊びもできるから、我が家もまた行きたいなぁ。みんなもこの春行ってみてね✨ 🎈神奈川県愛甲郡愛川町半原5423 本厚木駅or橋本駅よりバス OPEN　　8​：30～18：00（4月～9月） 8：30～17：00（10月～3月） 駐車場　　平日無料、土日祝は500円（普通車） ＊＊＊＊＊＊＊＊＊＊＊＊＊＊ 最後までご覧いただきありがとうございます☺ このアカウントは、神奈川発お出かけスポットや宿情報を発信しています✨ 他の投稿も見てみてね💛 →@neneko_3boys  #子連れお出かけ #子連れスポット #子供とお出かけ #公園遊び #神奈川ママ ',6070,391700,'neneko_3boys','["子連れお出かけ","子連れスポット","子供とお出かけ","公園遊び","神奈川ママ"]','https://m.tiktok.com/v/7479730848535776530','神奈川県愛甲郡愛川町半原5423','あいかわ公園','神奈川県愛甲郡愛川町にあるあいかわ公園を紹介する動画です。広大な敷地内にアスレチック、ロング滑り台、ターザンライド、巨大迷路、こども広場、ロードトレイン、じゃぶじゃぶ池など、様々な遊具や施設があり、子供連れで一日中楽しめる大型公園として紹介されています。年齢に応じて楽しめる施設が複数あるため、小さい子供から大きい子供まで楽しめる点が強調されています。料金、アクセス方法、営業時間なども記載されています。動画の雰囲気は、家族で楽しめる公園の魅力を伝える、明るく楽しいものです。',35.54169420000000201,139.2564026000000012,'2025-04-17T10:31:30.898+00:00','2025-04-18T03:09:03.477+00:00','5423 Hanbara, Aikawa, Aiko District, Kanagawa 243-0307, Japan','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcIwzp7junOuiQFX0tqJIjYq-IEx3OXlcVYZyVjp2mCCt-692tuM128CYknUBbAZuTKf-inSykvhkYa-VbiYnN9cGKiKgu0ViZlBfvhWU5cL1XhNhiPdthxQ4d0rucj7OBDuovvDIMTRkXYRIXsMUK9e1XdumPE_aC498o4Y6Ak0FGFPdm18LJVtsIfzNOHIbMSKkolX8h28n9Q_zNTW_CKaKWOH7sK1_VVcARa7icqm-gEO3DWw6QCbF4geo_GwXyDvtsACfTidnUgyhzS8rzMMNwbRElQWqns2cBJbOQ4jkRhKr13bjPBkT3vvlWPzn-lcq7peHcUY-jyDzYGsWn2rrFNl9XsAQIbHYdUwpCCbQDBcOqeKz_n5jXECKoCI7BXvdBt8CVz6iKfrYQ_3XfWpBOfJfe_KLIDgJ3G1HVjJxKaa9zTKRKyoki35sXcrBf_NSxMcRYXuiBzGd6j1RKgvG5GoeZK_7n7F8kALQyFCI8CBPoJWCq0a-TukgsILTYXjNHDSZrthpOMKKxki4v0Lh6elWyNG6g12OD7F8C9EY49UxYdd4rNsdsK7BWAh3PxktYPBKhS2CFnt6ZsCNYVxpmeTLLI0t2pb8NYP3pWxpn1eri388HlvUADzgAbI84G-og&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NULL);
