INSERT INTO places VALUES(1416,'「世界一のおにぎり」と称される太郎さんのおにぎりが最高！ 【おにぎり太郎】 世界中から声がかかっているおにぎり職人で、厳選したお米と海苔で握ったおにぎりは何個でも食べたくなる美味しさ！ 香ばしい海苔と熱々なおにぎりに舌鼓を打つこと間違いなし！ お客さんに美味しいものを提供しよう！という情熱を感じる素敵な職人さんです🍙 今回は麻布十番にある「焼き鳥まつもと」とのコラボが実現 全国から銘柄鶏を厳選しており、絶妙な火入れで仕上げた焼き鳥は全体的にプリっとしておりジューシー！ 柔らかめな食感に焼き上げられていて万人が楽しみやすい焼き鳥を楽しめます！ おにぎり太郎さんは全国の飲食店とコラボしていて、予約をすればコースの中でおにぎり太郎さんが握るおにぎりを食べられます！ 予約状況や今後の活動はおにぎり太郎さんの公式アカウントから随時チェックできるので、こまめにチェックをオススメします！！ #東京グルメ #japanfood #tiktokfood #longervideos ',1300000,13000000,'muni_gurume_japan','["東京グルメ","japanfood","tiktokfood","longervideos"]','https://m.tiktok.com/v/7407800749138185488','麻布十番 (焼き鳥まつもと)','おにぎり太郎 (焼き鳥まつもととのコラボ)','「世界一のおにぎり」と称されるおにぎり太郎と、麻布十番の焼き鳥店「焼き鳥まつもと」のコラボレーションを紹介する動画です。厳選されたお米と海苔を使ったおにぎり、そして全国から銘柄鶏を厳選し、絶妙な火入れで仕上げたジューシーな焼き鳥が紹介されています。おにぎり太郎のおにぎりは、予約制でコース料理の一部として提供されているとのことです。お店の雰囲気や内装については動画からは不明です。',35.65345099999999689,139.7342869999999949,'2025-04-17T10:40:20.717+00:00','2025-04-18T03:09:28.750+00:00','Japan, 〒106-0045 Tokyo, Minato City, Azabujūban, 3-chōme−8−４ 麻布Ｋ’ｓビル 1F','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcKYnurDjliY7QYk2dVagmtceNrKiqcEEuC2Woczkc-7ERxdyjFfYxwzFeyo1xw98BcrQCjn0Br28oj3ergTLrjA5utLI9jhIJfzD1kgmnJaAVrsx1dC9t2Ee1dulcmVTuneNNQUShk91ddhI66TYyNkB4w6VkHUEA6puoOOV9GVlkpKEGBejbrJdBTfVSDoCMBJS7wodNmtMiIzs38faMMIVfJke0Ws1l7pvKyrGFIj9oKMangMYa4gzeYf-9RQhf32fG7byH2L3_YlNQx6mt8qYsvh-bAJ7CbYKNe8hrZjTz_0bwSfkO6aXa4awxK7tEW2jlBCZrs&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NULL);
