INSERT INTO places VALUES(1476,'\ 2/1スタート！大人がこどもになる体験👧🏻 / 大人がこどもの視点を 12の体験を通して 楽しみながら学べるイベントが始まったよ🍼 巨大おむつがインパクト大👶🏻 会場の外からも目を引くココ ☝🏻おすすめpoint ☑︎ 2歳になってママと歩くとこんなに早くて疲れる…😮‍💨をウォーキングマシンで体験🚶‍♀️ ☑︎ 2歳から見た朝食はこんなに大きい🥣 　牛乳を溢しちゃう気持ちがわかる体験 ☑︎ ランドセルの重さを大人サイズで体験🎒 　最初立てない?!と思うほど重かった！ ☑︎ 新生児から生後3ヶ月、8〜18ヶ月、3歳の見え方をタブレットを通して見れるよ。 　赤ちゃんの視え方に衝撃👀 ☑︎ 赤ちゃんは話したくても泣くしかない体験のできるマスク ☑︎ \ あるある/ がいっぱいの裏こどもずかん ☑︎ スタンプラリーのスタンプが可愛い♡ 　全部集めたら風船がもらえるよ🎈 ☑︎ IKEAのおもちゃで遊べるキッズスペースも子ども喜ぶ🤗 どの体験も面白くて、知らなかったこともたくさん。 こどもの視点を理解したら、 少しやさしくなれるかも.. 🤍 ITOCHU SDGs STUDIO KIDS PARK 併設の こどもの視点カフェにも展示があるから 見たことある！って人もいるかもだけど 今回の展示では体験コンテンツは 12に倍増してパワーアップしてるよ🫶🏻 ぜひ行ってみてね✨ ⚠️注意point ・VR とウォーキングマシンは年齢制限があり小さい子はできないものもあるよ —— information — もっと！こどもの視展  ～こどもになる12の体験～ 📍二子玉川ライズ スタジオ & ホール 🗓️ 2025年2月1日(土)～2025年2月25日(火) 🏢 東京都世田谷区玉川1丁目14−1 二子玉川ライズS.C. テラスマーケット2F 🕒 11:00〜19:00（最終入場18:30） ※最終日は最終入場16:30 🚃 二子玉川駅東口から 徒歩 4分 🎫 大人：1,500円　18歳以下：1,200円　小学生以下：無料 🍼子連れpoint ・ベビーカー：⚪︎  ・おむつ交換台：⚪︎  ・授乳室：⚪︎(二子玉川ライズS.C.内にベビールームあり) @kodomonoshiten  おでかけ前に、HPなどで最新情報をcheckしてください🌿 ┈┈┈┈┈┈┈┈┈┈┈┈┈┈┈┈┈┈┈ #子連れおでかけ #子連れスポット #子連れおでかけ東京 #東京子連れスポット #東京子連れおでかけ #子連れイベント東京 #こどもとおでかけ #こどもの視展 ',56000,2700000,'ayamama_photrip','["子連れおでかけ","子連れスポット","子連れおでかけ東京","東京子連れスポット","東京子連れおでかけ","子連れイベント東京","こどもとおでかけ","こどもの視展"]','https://m.tiktok.com/v/7468528634710560018','二子玉川ライズ スタジオ & ホール (東京都世田谷区)','もっと！こどもの視展 ～こどもになる12の体験～','二子玉川ライズ スタジオ & ホールで開催されている、「もっと！こどもの視展 ～こどもになる12の体験～」というイベントを紹介する動画です。  大人になって忘れがちな子供の視点を取り戻すための12種類の体験型コンテンツが用意されていることが説明されています。巨大おむつ、ウォーキングマシンでの体験、ランドセル体験、赤ちゃんの視覚体験、赤ちゃんが感じることを体験できるマスクなど、様々な体験を通して子供の気持ちを理解することを促すイベントです。併設のこどもの視点カフェにも展示があるとのこと。ベビーカー、おむつ交換台、授乳室も完備されているようです。',NULL,NULL,'2025-04-17T10:40:20.886+00:00','2025-04-18T03:09:52.561+00:00',NULL,'https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcKtBbvNGdaGTxnVSHzKeIb2CBj7ILLKWvtSa8NpV8h5e03fdZ6qACLTsITuH3d2WUnPR9-xcIptrXXmiv2XDSlQxd4zJF72tljAMVSHFPkWI5voDtBY1BVi_xBz8Llfs_8YzKMvbREgmG8REwqlgiM3NKLAPGLERlqGi0s8yxhnRPa8xdYBsBaGfSyCtMk9kFqK-ktd0snwzt9Vkjggn3jtQfUievC