INSERT INTO places VALUES(1511,'地図がないので、五感だけを頼りに探索する神秘的なミュージアムが凄すぎた😳 ポイントは下に書いてます🙋 《施設情報》 📍teamLabBorderless   チームラボボーダレス 🗺 麻布台ヒルズ ガーデンプラザB B1 東京都港区麻布台1-2-4 🚃 「虎ノ門ヒルズ」駅　直結 🕰 10:00 - 21:00 * 最終入館は閉館の1時間前 🎫 大人¥3,800〜 💤 第一・第三火曜日 新作を含む50作品以上のアート作品 たちが圧巻すぎた...!! 境界なく連続する１つの世界の中で、 さまよい、探索し、発見する。 自分で描いた絵に命が吹き込まれ、 実際に会場で泳ぎ出したり、 アートを感じられるカフェがあったりと 楽しみ方が無限大にある 全く新しいミュージアムでした😳 映像も毎回変わるので、 2回目に行くとまた違った世界も味わえて、 興奮と驚きの連続でした❤️‍🔥 🌟ポイント🌟 ・予約は今完売でもこまめにみたら 空きが出るかもです！ ・所要時間は2〜3時間は想定した ほうがよいです！ ・作品は隠れた部屋にあったり するので見つけるのが難しいため くまなく探すのが必要です！ ・作品数が多いので、 事前にこれは見たいというのものを チェックした方がよいです！ できたばかりで大注目のスポットにぜひ🙋 ✂︎-——————✄ -——————✄  ⁡ 私たちのアカウントでは、 ⁡ ✎𓂃おでかけに役立つ情報 ✎𓂃同棲の参考になる情報 ✎𓂃デート、旅行、ホテルなどなど... ⁡ 暮らしが豊かになる情報を発信していきますᴥ ⁡ コメント、いいね、フォローしてもらえると 嬉しいです🍯　 ⁡ ✂︎-——————✄ -——————✂︎ ⁡ #麻布台デート #麻布台デートスポット#麻布台美術館デート  #麻布台お洒落デート #麻布台大人デート #麻布台展覧会 #麻布台美術館 #麻布台ヒルズデート #麻布台ヒルズデートスポット#麻布台ヒルズ美術館デート  #麻布台ヒルズお洒落デート #麻布台ヒルズ大人デート #麻布台ヒルズ展覧会 #麻布台ヒルズ美術館 #東京美術館 #teamlab #チームラボ #teamLabBorderless #チームラボボーダレス #チームラボ麻布台 #チームラボ麻布台ヒルズ #tokyo #tokyoart #tokyotrip',20400,1300000,'tokiumi_style','["麻布台デート","麻布台デートスポット","麻布台美術館デート","麻布台お洒落デート","麻布台大人デート","麻布台展覧会","麻布台美術館","麻布台ヒルズデート","麻布台ヒルズデートスポット","麻布台ヒルズ美術館デート","麻布台ヒルズお洒落デート","麻布台ヒルズ大人デート","麻布台ヒルズ展覧会","麻布台ヒルズ美術館","東京美術館","teamlab","チームラボ","teamlabborderless","チームラボボーダレス","チームラボ麻布台","チームラボ麻布台ヒルズ","tokyo","tokyoart","tokyotrip"]','https://m.tiktok.com/v/7337299680373542151','麻布台ヒルズ ガーデンプラザB B1 (東京都港区麻布台1-2-4)','teamLab Borderless','東京都港区麻布台にあるチームラボボーダレスを紹介する動画です。  境界のない空間で、さまよい、探索し、発見するといった体験ができるミュージアムとして紹介されています。  50作品以上のデジタルアート作品があり、自分で描いた絵が動き出すようなインタラクティブな展示や、アートを感じられるカフェなども存在すると説明されています。  予約状況や所要時間、鑑賞のポイントなども解説されています。動画の雰囲気は、チームラボボーダレスの独特な世界観を伝える、幻想的で、魅力的な雰囲気です。',35.66206890000000129,139.7432670999999971,'2025-04-17T10:40:20.968+00:00','2025-04-18T03:10:12.286+00:00','Japan, 〒106-0041 Tokyo, Minato City, Toranomon, 5-chōme−9−９ Azabudai Hills Garden Plaza B, B1','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcJ66QRXr-kHypHwgtIHFmBAaSH6hHAKvkgi2h