INSERT INTO places VALUES(1554,'絶対に行きたい！最新！新大久保 . 韓国女子の聖地でもある新大久保。 韓国で人気になっているものをダイレクトに楽しめるのも魅力。 . そしてどこも「おいしい」「インスタ映えする」という女子のワガママを全部かなえてくるんです。 . 今回は、最新の新大久保・注目スポットをご紹介します。 . 【FRIENDS STORE】 韓国で大人気の雑貨ショップARTBOXがついに新大久保に登場！ 今まで韓国に行くたびに爆買いしていた、という人もこれからは新大久保でゲットできます♪ このかわいくて癒し系のキャラクターのグッズも豊富にそろっていますよ♥ . 【CAFE iN】 大注目の最新カフェ兼フォトスポットが誕生しました！ １０月にオープンしたばかりなのに、すでに話題沸騰なんです。 デザートと食事はどれもおいしいし、日本のカフェにはないものばかり。一面に広がるススキ畑でまるで韓国にいるような気分に♥ . 【DONUT&COFEE TWISTY】 かわいすぎる、と話題のクァベギのお店も大注目。 カラフルなクァベギが何種類も並んだ姿は写真を撮らずにはいられません。お店のメインキャラクターもポップでかわいいですよね♪ . #韓国カフェ #新大久保グルメ #新大久保カフェ #新大久保デート #新大久保 ',4000,817300,'koreanstyle_lplp','["韓国カフェ","新大久保グルメ","新大久保カフェ","新大久保デート","新大久保"]','https://m.tiktok.com/v/7169120716359601409','新大久保','FRIENDS STORE, CAFE iN, DONUT&COFEE TWISTY','東京の新大久保にある韓国関連の注目スポット3ヶ所を紹介する動画です。韓国の人気雑貨ショップFRIENDS STORE（ARTBOX）、話題のカフェ兼フォトスポットCAFE iN、そして可愛いクァベギが人気のDONUT&COFEE TWISTYが紹介されています。それぞれの店舗の雰囲気や、メニュー、商品の魅力などが紹介されていると推測できます。料理や食事に関する情報は、各店舗のメニューが詳しく紹介されていると考えられます。動画の雰囲気は、韓国トレンドのグルメやショップを紹介する、明るく、魅力的な雰囲気です。デートスポットとしてもおすすめできる点が含まれていると考えられます。',35.70138610000000056,139.7028608999999904,'2025-04-17T10:40:21.061+00:00','2025-04-18T03:10:29.178+00:00','Japan, 〒169-0072 Tokyo, Shinjuku City, Ōkubo, 2-chōme−32−１ 2F','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcKyp9lDXjIZxKjzOTbdnqsW6qUWX7TCIfnAatsO2asvrOQUQ6ytDAuNimQUJDIumQUnlqorb4O9fqFqxtdNW9aXoo0dDOGkGxF9KJAWiwuNXq1d-kbWH5_tceeEmGnCh4NcfRR_Ka7yJQ6L7tesl9tKgvBobWIfbFyBBzEc550nVnu54w8g6CHbiM8QkLWPZU9QEoGpnLjAm-iJHxmflPtGxIy6NXuA0SotRzOLUOVtR2SzkkSjxa21c78gYSHhkb5UTdMwZsK-rjP-7HUmLyBej0_iZmy6CYjAsHEzOp5UixN9sqtrG6NVviFHiMae47hEox8l84YnanTx9zabO7h0htX4NZljDNy6L8h-ZoIGpv4MZLhB7kE5QsIbDVpZITK9EOPebbrPu1VyiNtMZX-NQmRr5qChM3MHaDSaN_P9lusdnqLV-F-KceoVo6IViAuhJ4AqaFVwoQwFbE0Msj-wXD53bubAgFVlBgNOoMrbPCu98kLniozWH2CndyUMoHbRdPZObgfdMIBT79vLHTM0UgDHGrf9KnB4fNR8fJ9PztQnSLoRnyUEO9D1-5iVq6K5FxCiGxKUD0KClknSvWzBKVDOxweW8YLraPBCYHvkZdAzt-HlBARCKuXQsfsiA69Y2XDL&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NU