INSERT INTO places VALUES(1559,'付き合ってください！ #07 #jk #東京 #運営さん大好き #fyp ',2180,52000,'aaaaachhh426','["07","jk","東京","運営さん大好き","fyp"]','https://m.tiktok.com/v/7459046478837861650','東京 (具体的な場所は不明)','不明','東京で撮影されたと考えられる動画で、交際を申し込む内容の動画です。具体的な場所は不明で、動画の内容から推測する必要があります。料理や食事に関する情報は一切ありません。動画の雰囲気は、交際を申し込むという、緊張感や期待感を含む雰囲気です。投稿者は高校2年生(07)の女子高校生であることがタグから分かります。',NULL,NULL,'2025-04-17T10:40:21.072+00:00','2025-04-17T23:48:22.651+00:00',NULL,NULL,NULL);
INSERT INTO places VALUES(1560,'映画のなかにタイムスリップ！？ 明治時代の街並みが残ってます。 0,2歳児を連れなので、混雜していないところがいいなぁ…と思い立って来てみたら大正解！ 混み具合は、三連休でもこんな感じで、平日はさらにゆったりしてるので、小さい子ペースで歩いても問題ないのが助かる◎ 駅を出てすぐ参道なのも、めちゃくちゃありがたい✨ 目的地までの移動が一番大変だったりするの私だけでしょうか😇 📍#柴又帝釈天参道  住所：東京都葛飾区柴又 アクセス：京成金町線柴又駅からすぐ 📍#柴又帝釈天 （題経寺） 📝おすすめグルメ @ojigi_chaya  参道に入る直前にあります。子どもたちにカラフルな風船を配ってた！動画に出てくるレインボークリームソーダのほか、主な腹ごしらえはここでしました♪食べ歩き、店内、軒下どれでも対応可能。映えスイーツからおつまみから定食までありました😋 #高木屋老舗  参道入ってすぐ。参道をはさんでおみやげ屋さんと喫茶の二店舗あります。名物「草だんご」も😊かき氷とお団子(撮り忘れた)を頂きました😋 周辺スポットもまたレポします✌️ ◉◎◉◎◉◉◎◉◎◉◉◎◉◎◉ 0,2歳の年子育児に奮闘するママ。 旅行会社さん、自治体さん、観光局さんをサポートして「やってみたい」を叶える面白ツアーを200以上プロデュース。3000名以上と旅しました😊 みんなで理想の子連れ旅を作るコミュニティ作ります🚗 投稿は、実際に行った場所や体験から。リアルな情報です😊◉◎◉◎◉◉◎◉◎◉◉◎◉◎◉ #柴又 #草団子 #東京かき氷 #下町グルメ #下町散歩 #穴場スポット',1993,291900,'tabimama.manamin','["柴又帝釈天参道","柴又帝釈天","高木屋老舗","柴又","草団子","東京かき氷","下町グルメ","下町散歩"]','https://m.tiktok.com/v/7122274041213373698','東京都葛飾区柴又','柴又帝釈天参道、柴又帝釈天（題経寺）、お地蔵茶屋、高木屋老舗','東京都葛飾区柴又の帝釈天参道周辺を紹介する動画です。  明治時代の街並みが残る柴又帝釈天参道、柴又帝釈天（題経寺）とその周辺の観光スポット、そして参道にある「お地蔵茶屋」と「高木屋老舗」の２店舗が紹介されています。「お地蔵茶屋」ではレインボークリームソーダなどの映えスイーツや定食などが、「高木屋老舗」では草団子やカキ氷などが楽しめるようです。  子連れでも楽しめる場所として紹介されており、混雑状況やアクセス方法なども説明されています。',35.75775159999999886,139.8765325999999903,'2025-04-17T10:40:21.074+00:00','2025-04-18T03:10:32.046+00:00','7-chōme-7-4 Shibamata, 葛飾区 Katsushika City, Tokyo 125-0052, Japan','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcJrbF5ox4YKin-5cH7JjCVUmbWkJwTJR9PwK9jJBCh34BA0WSVj6bEa1NVHBudM4Ay6M_fldyzDWeA9aZzqHdzO0O1QFEesHuZ0xqIXrNr0fdLXJxHUy_ae1rZnKjs1w4poPEA0amsphxJeagbSRTMhWA9wqGyCbGINrslmiKchqEyi7KuEDPuShpMf6x4wtTLDFwc2oXvKcy8mVBrC1X32GIYuSgFXGeOmOz4Y8rAkYmfI9FzmeX-k_SvlsWBHGhsONFW9HrCHBd5HCSk61hFCfr0CoA-uCKwouUh5WY9IWAJAWpGWiSC1txx3lxr9VNGucCsD_W38dr1pwdqjs9x98dM2A2Io7Y2fAIIcVVTF5anCfjsEyy6ynkKV5E7Trg0hjD7rLAvVufEO2SW1b5pYX7q1LPHbcD7ZKf7wCYXZbe6Wy8nYUlviwBD7xqPOoZkNBbCFPuvZatRQxmmLWK_8Lq3m3Grw2F8QUxHoTv6AOgcaEVdzPYpIQHUk2fhQ-Nb7myFyhAQ9C8IuY92g26-sl00ayhhnfLkqjgLgdjHkyfJsws4WMaHmDqjG-CFXmxADz6iGMqBIqqBqQPJy3yCHqi3dgX28K1ooCyp-6LIvcn