INSERT INTO places VALUES(1574,'2025年行かなきゃ損‼️  アート　一人旅‼️ 東京でオススメ美術館 東京は多様なアートや文化に触れられる場所が多く、美術館巡りは一人でもグループでも楽しめます。 ①国立新美術館（The National Art Center, Tokyo） 六本木に位置し、国内最大級の展示スペースを誇る美術館。 常設展はなく、企画展が中心なので、訪れるたびに新たな展示を楽しめます。 建築家・黒川紀章が設計したガラス張りの建物自体も見どころ。 〜おすすめポイント〜 国内外の重要なアート展が頻繁に開催されます。カフェやミュージアムショップも充実。 ②東京都現代美術館（MOT / Museum of Contemporary Art Tokyo） 清澄白河エリアにある現代アートに特化した美術館。 国内外の現代アーティストの企画展が豊富。 常設展では日本の現代アートの歴史を体系的に楽しめる。 〜おすすめポイント〜 清澄白河のカフェ巡りと合わせて訪れるのもおすすめ。美術館周辺の公園でリラックスも可能。 ③森美術館（Mori Art Museum） 六本木ヒルズの最上階に位置する美術館。 現代アートを中心に、国際的な展示を多く開催。 展望台「東京シティビュー」からの絶景も楽しめる。 〜おすすめポイント〜 夜間営業があるため、夜景とアートを一緒に楽しむことが可能。 都市とアートの融合を体感できるスポット。 ④三菱一号館美術館（Mitsubishi Ichigokan Museum） 丸の内にある西洋近代美術をテーマにした美術館。 建物は明治時代の洋風建築を再現しており、雰囲気も素晴らしい。 印象派や19世紀ヨーロッパ美術の展示が多い。 〜おすすめポイント〜 丸の内散策と合わせて訪れるのがおすすめ。 美術館内のカフェ「Café 1894」も人気。 ⑤上野の森美術館（Ueno Royal Museum） 上野公園内に位置し、アクセスが便利。 日本のアートを中心とした企画展が充実。 日本画や洋画、彫刻など多彩なジャンルの展示を楽しめる。 〜おすすめポイント〜 上野動物園や他の文化施設とセットで訪れると効率的。 上野公園の自然も散策できる。 ⑥東京国立博物館（Tokyo National Museum） 日本最古の博物館で、日本美術や文化財の宝庫。 本館では日本の伝統美術を、東洋館ではアジアの美術を鑑賞可能。 特別展も頻繁に開催され、見応えがあります。 〜おすすめポイント〜 日本美術に興味がある方には必見のスポット。 日本庭園や茶室も見どころ。 ⑦サントリー美術館（Suntory Museum of Art） 六本木の東京ミッドタウン内にある美術館。 「生活の美」をテーマに、日本の伝統工芸や美術品を展示。 茶道具や陶磁器など、日本文化の繊細さを堪能できます。 〜おすすめポイント〜 東京ミッドタウンでのショッピングや食事と合わせて楽しむのがおすすめ。 ⑧根津美術館（Nezu Museum） 表参道に位置し、日本・東洋美術を収蔵。 庭園が美しく、アートと自然を同時に楽しめる。 書や陶磁器、漆工など多彩なコレクションがあります。 〜おすすめポイント〜 美しい庭園を散策しながらリフレッシュ。 表参道・青山エリアの観光と組み合わせると便利。 ⑨すみだ北斎美術館（Sumida Hokusai Museum） 葛飾北斎をテーマにした美術館で、墨田区に位置。 北斎の浮世絵や版画、関連資料を展示。 建物は建築家・妹島和世によるモダンなデザイン。 〜おすすめポイント〜 東京スカイツリー周辺の観光とセットで訪れるのが便利。 日本の伝統文化を学びたい方におすすめ。 ⑩杉並アニメーションミュージアム 東京のアニメ制作の歴史や技術を学べるスポット。 アニメファンにとっては必見の施設。 実際にアニメ制作を体験できるコーナーもあります。 〜おすすめポイント〜 家族や友人と楽しむのはもちろん、一人でじっくり見学も可能。 杉並区のカフェや公園をセットで訪れると楽しい。',457,73200,'japantravelspot','[]','https://m.tiktok.com/v/7468556373559708935','東京 (複数の美術館)','2025年行かなきゃ損‼️ アート 一人旅‼️ 東京でオススメ美術館','東京にある10個の美術館を紹介する投稿。国立新美術館、東京都現代美術館、森美術館、三菱一号館美術館、上野の森美術館、東京国立博物館、サントリー美術館、根津美術館、すみだ北斎美術館、杉並アニメーションミュージアムが挙げられており、それぞれの特徴やおすすめポイントが説明されている。料理に関する情報は含まれていない。各美術館の建築様式や展示内容、周辺環境などが説明されており、一人旅におすすめのスポットとして紹介されている。',35.66528900000000135,139.7263739999999928,'2025-04-17T10:40:21.114+00:00','2025-04-18T03:10:38.679+00:00','7-chōme-22-2 Roppongi, Minato City, Tokyo 106-8558, Japan','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcKO7F6Vtty2bf7khdIGm-bvd0TowjS7hPrvclKViFgZVI5O-Pr-ny8d-pF88h66c4clEU0HjqBCp6ZpQefOnzUr3b-W0duUN9ovfVsBxjplV9uD_bLjvPDCsNLzBnBnuhia5ANKoMTU6qp7-N02T7aC0HfvEckeu2dFa6nL8BbY9-7aGVFSGhIKB3g_gGwbDkkpGBKfElzc2Ulx9PdfIQXEN9Mx5b-blpV-j0c0iudsognyuJUzpiWuchd5l67bR1-uNeaXbfLiOKT-C2rssx1KIGzHk84p1l-tXFtKjSKI0ELMAw16vUt-7eE7-9VpXv_iSX6SP47GXJ7qxbWMss9S2wu3DikYR_bzQjFyV0XvsrizcjLtXceeEXEDjz4DmhAN54JLm9TqUlgnwqRP21MAUhzu6xav4oVMH7B78z2-LWZQvHAky4SQLtCEVCXnEgcGbp-ff86jnAmSHDAAw3fJhdwgRT1cTJit1XCuGcVs7lGU5eRvT0ed6OKLi7fMhpqXGTQrSOk38NEj5vdBOciSjYDPnMw52LFiBbZOutO2Qj1J9g_KMBSgf_1wsxZzwtMNynWJKeTLabCRJmA4cYdfkrFd7Ou9-99rw_Vimiw-FcuqEHnU9eV0s543_MZ4TBJWYUHF&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NULL);
INSERT INTO places VALUES(1575,'昼の豊洲に行ってきました！ 子供が沢山いてとても賑やかでした！ ここの芝生で昼寝するのが好きです😴 撮影場所   豊洲公園 #豊洲#japan #風景 ',442,19300,'omusubidaze','["豊洲","japan","風景"]','https://m.tiktok.com/v/7469687933432253714','豊洲公園 (東京都江東区)','昼の豊洲に行ってきました！','東京都江東区豊洲にある豊洲公園の様子を撮影した動画。子供連れが多く賑やかで、芝生での昼寝が気持ち良いという投稿者の感想が述べられている。料理に関する記述はない。公園の風景がメインで、のんびりとした雰囲気であることが推測できる。',35.64077540000000254,139.7776920000000018,'2025-04-17T10:40:21.117+00:00','2025-04-18T03:10:39.248+00:00','6-chōme-1番-先 Toyosu, Koto City, Tokyo 135-0061, Japan','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcJOkbNnT-aCmX-Z7X30RkO-wHL8z9x7RfKh8R30YaiwMd73uvK0SAc_a-h0U1v5thNr3XAD96P3yGBT4yQ1NbhcR8M4Tuoh_TpofI4aLDPMAZzTkFreTwvMAPYv4L_EKsjgMwoMkSSv7KbR0inCBbCzmhk6H99QR6L9A1vF9u8Vg8sSrGEw3tDES3SV5ievs-e6OcCBkKrdOYr_6INXDtU50C4GcIMSPzGyB8zoP_DB4j1orrlJMTyQAXbVAPPQ3qj21uKFQzE6_UaaOr0CtTbpOnwgV82z2a9SYrQDWf9bbzDd49NL_NgBfUzFO7fcB7-qQ0znV1pqxW6s8ydZNMZmRknlAKXrM8K1dCe4ugELCAt2rcZBrTsFX-ZB1svjUB3TsooxBfUWAWWItGll3ZBrFEP5AxhsZMe8xECbjXrBtyb0uigRZENId0CVG7MS2pzXgDHiikavdM8yf9oaDdLHy556TKszwtHq9xcStT2to0cVYOf8IlGc4KZ_w8CC9KXCPFxe7gv7SGa5G9A6djoNhoJCfl8ePDgW28JZbGOs0O4w3fjQdJRiew27e47EbUqS18zLQU087Ji3UR3BLioQHwNsZmjgKZfI7CpAn2ZycB_l6fUFRVMMO88k_j3paV-rVg&key=AIzaSyBtO56PRzOCgzVbTYOJewuh1wPEfVnTF50',NULL);
INSERT INTO places VALUES(1576,'💕東京大人気商店街10選💕 1⃣ 上野アメ横商店街 🚇 上野駅 ✅ 朝から晩まで賑やかな商店街で、アメ横丁には400軒以上の店舗があり、1日では回りきれないほどです。衣料品、靴、バッグから新鮮な食品、薬局、お菓子屋、雑貨店まで、さまざまな店があります。 2⃣ 池袋商店街 🚇 池袋駅 ✅ 東京の飲食、買い物、遊びの中心地！東武西武などの百貨店が集まり、多くの家電ショップが駅の各出口にあり、アニメや二次元、中華料理、小さな公園などがそろっています。中国語の案内があり、City Walkや熱狂的な買い物ができ、どんなニーズにも応えます。 3⃣ 浅草新仲見世商店街 🚇 浅草寺駅 ✅ 着物のレンタルができ、伝統的な日本の髪型と共に、活気あふれる浅草の街を人力車で楽しむことができます。地元の味を楽しむことができ、長さ250メートルの通りには可愛らしい工芸品や記念品がたくさんあります。 4⃣ 戸越銀座商店街 🚇 戸越銀座駅 ✅ グルメ好きにはたまらない場所で、多くの屋台やレストランがあります。400以上の店舗が集まり、さまざまな味覚を満たします。 5⃣ 谷中銀座商店街 🚇 千駄木駅 ✅ "ネコ横丁"として知られ、猫たちが自由に歩き回り、街に温かみを与えています。小さなが商店街で、さまざまな老舗が集まり、日用品や伝統的な衣類、和菓子、お茶などがそろっています。 6⃣ 武蔵小山商店街 🚇 武蔵小山駅 ✅ 800メートルのアーケード市場で、新鮮な野菜や日常の雑貨、衣類を見つけることができます。地元の人々も楽しんでいるため、ゆったりとした散策が楽しめます。 7⃣ 吉祥寺SUN ROAD商店街 🚇 吉祥寺駅 ✅ さまざまな雑貨店や飲食店があり、ジブリ美術館などのアニメファンのスポットが集まります。アニメに登場する食べ物も見つけることができ、井の頭公園の中にある日本の雑貨屋と現代建築の交差点では、アニメと現実の境界線を感じることができます。 8⃣ 高円寺商店街 🚇 高円寺駅 ✅ 食べ歩きを楽しんだり、お店を巡るのが楽しい場所です！地元の食べ物だけでなく、コストパフォーマンスの高い美味しいタイ料理も楽しむことができます。気象神社では晴れの日のお守りを手描きで作ることができ、純情商店街やパル商店街で買い物ができ、中古のアクセサリーや家具店でも気に入った商品を見つけることができます。 9⃣ 巣鴨地蔵通り商店街 🚇 巣鴨駅 ✅ 建物のスタイルは昭和時代に一瞬戻り、80年の歴史を持つ大福饅頭の老舗や、日本の代表的な童話のキャラクター「金太郎」をモチーフにした手作りのキャンディなど、昭和時代の魅力を存分に楽しむことができます。 🔟 自由が丘商店街 🚇 自由が丘駅 ✅ 街の両側にはさまざまな雑貨店があり、食べ物も充実しています。また、写真映えする街並みも魅力の一つです！都会の中を歩いているのに、車の騒音から離れたゆったりした時間を感じることができます。 #東京#大人気 #商店街 #賑やか #日本观光 #citywalk #shopping#japan #tokyo ',382,237200,'lemon7777','["東京","大人気","商店街","賑やか","日本观光","citywalk","shopping","japan","tokyo"]','https://m.tiktok.com/v/7356087796936838407','東京 (複数の商店街)','💕東京大人気商店街10選💕','東京の人気商店街10選を紹介する投稿。上野アメ横商店街、池袋商店街、浅草新仲見世商店街、戸越銀座商店街、谷中銀座商店街、武蔵小山商店街、吉祥寺SUN ROAD商店街、高円寺商店街、巣鴨地蔵通り商店街、自由が丘商店街が紹介されており、それぞれの商店街の雰囲気、アクセス方法、特徴的なお店などが説明されている。具体的な料理名は挙げられていないものの、多くの飲食店があることや、地元の食べ物、タイ料理などが楽しめることが触れられている。全体的に活気があり、買い物や食べ歩きを楽しめる賑やかな雰囲気であることが分かる。',35.70897800000000188,139.7747155000000135,'2025-04-17T10:40:21.120+00:00','2025-04-18T03:10:39.732+00:00','6 Chome-10 Ueno, Taito City, Tokyo 110-0005, Japan','https://maps.googleapis.com/maps/api/place/photo?maxwidth=800&photo_reference=AeeoHcJF5wsHcc