INSERT INTO places VALUES(1590,'私はリモコンを持って東京の電気をつけます。#東京#渋谷#渋谷スカイ#夜景 #日から夜への変化 ',57,1009,'vince6128','["東京","渋谷","渋谷スカイ","夜景","日から夜への変化"]','https://m.tiktok.com/v/7494116629916257544','渋谷スカイ (東京都渋谷区)','null','渋谷スカイからの夜景を撮影した動画。タイトルにある「リモコン」は比喩表現で、実際にはリモコンで電気を操作しているわけではないと推測できる。渋谷の街並みが日中から夜へと変化する様子が映し出されていると考えられる。料理に関する記述はない。渋谷スカイからの眺め、夜景の美しい雰囲気などが中心となる動画と推測される。',NULL,NULL,'2025-04-17T10:40:21.152+00:00','2025-04-18T00:13:20.961+00:00',NULL,NULL,NULL);
INSERT INTO places VALUES(1591,'東京の下町が好き。初めて来るのに何処か懐かしい感じがする。#東京#下町#tokyo #japan #nostalgic #peaceful #穏やか#街並み#上京 #大学生 #夕日#sunset #懐かしい#景色 ',38,610,'eitotravel','["東京","下町","tokyo","japan","nostalgic","peaceful","穏やか","街並み","上京","大学生","夕日","sunset","懐かしい","景色"]','https://m.tiktok.com/v/7480161799107644680','東京の下町エリア (場所不明)','null','東京の下町エリアの街並みを撮影した動画。具体的な場所は不明だが、古き良き日本の情緒を感じさせる、落ち着いた雰囲気の場所であることが伺える。夕焼けの景色も映っており、穏やかで懐かしい気持ちになるような雰囲気だと推測できる。料理に関する情報は含まれていない。',NULL,NULL,'2025-04-17T10:40:21.154+00:00','2025-04-18T00:13:26.925+00:00',NULL,NULL,NULL);
